INSERT INTO `blog_translations` (`id`, `blog_id`, `title`, `content`, `seo_url`, `locale`, `keyword`) VALUES
(1, 2, 'ベトナムのお正月(テト)', 'ベトナムのお正月(テト)のご紹介です。<br>\r\n<br>\r\nベトナムは陰暦の暦を使っており、ベトナムのお正月も陰暦により毎年１月下旬に始まったり、２月上旬だったりと変わります。<br>\r\n<br>\r\nさて今年のテトの元日は2月8日でした。<br>\r\nベトナムの国の定める祝日は5日ですが、そんな短い休みなんて正月じゃありません。今年の国家機関のテト休みは2月6日～2月14日(旧暦の12月28日～1月7日)の9日間となりました。<br>\r\n<br>\r\nベトナムは世界でもを1、2を争うほどの祝日が少ない国だと言われています。そのため、テトは田舎に帰るための貴重な長いお休み。<br>\r\n日本人の駐在員の方々も、テト中、日本にご帰国される方が多いかと思います。<br>\r\n中国が旧正月に伴って、民族大移動と言いますが、ベトナムも同じようなイメージです。<br>\r\n<br>\r\n実際、仕事でいうと、弊社はアパートのオーナーさんを相手に仕事をするわけで、テト前１週間からテトの準備、忘年会で連絡がつかなかったり、連絡できても飲み会の席でよく聞こえなかったり…。<br>\r\nそして、テト明け一週間も、まだ田舎に帰っているオーナーさん、新年会等々で全く仕事モードに入っていないわけです。<br>\r\n結局、テト前後の１カ月はあまり仕事もはかどりません。<br>\r\n<br>\r\n日本の場合、4月のご赴任に備えて1～2月より部屋を探されるお客様も多く、弊社としてもかなり焦ります。<br>\r\n<br>\r\nテト前に契約して、テト休みを心置きなく過ごしたい方。テト明けに早速、次の部屋を見つけるか！！と意気込んでいらっしゃる方。そんな方が多数、いらっしゃいます。<br>\r\nそこで弊社のスタッフが、こんなオーナーさんのお尻を叩いて仕事をしてもらうわけです。<br>\r\n<br>\r\nこんな具合に、ベトナムにとってのテトはベトナム人にとってとっても大事なお休みなんですね。<br>\r\n<br>\r\n一方年末年始のハノイの街並みはと言いますと<br>\r\n<br>\r\n年末、<br>\r\n2月6日のテト休み一週間前より、徐々にハノイから人が減り。<br>\r\n2月5日の弊社の事務所も、いつも20人ほどいる事務所がこんな感じです↓<br>\r\n<br>\r\n<img src=\"http://222.252.25.162/vnhousing/public/assets/blog/a.jpg\" style=\"width: 600px\" alt=\"ベトナムのお正月(テト)\" /><br>\r\n <br>\r\nハノイのいつもの人混みの街が、こんな感じです↓<br>\r\n<br>\r\n<img src=\"http://222.252.25.162/vnhousing/public/assets/blog/b.jpg\" style=\"width: 600px\" alt=\"ベトナムのお正月(テト)\" /><br>\r\n<br>\r\nぱらっぱら。<br>\r\n<br>\r\nそして、テトに飾る、梅の木を準備する様子が、こんな感じです↓<br>\r\n<br>\r\n<img src=\"http://222.252.25.162/vnhousing/public/assets/blog/c.jpg\" style=\"width: 600px\" alt=\"ベトナムのお正月(テト)\" /><br>\r\n <br>\r\nこれはまだ車に梅の木の枝なので、見た目は良い方です。<br>\r\n通常は、バイクに梅の木や小みかんの木が植わったものを植木鉢ごと積んで道路を走るんです。<br>\r\n<br>\r\nとうことで、すっかり町はテト一色です。<br>\r\n<br>\r\nそして我が家はと言いますと、<br>\r\n主人の実家のあるホアビン省へ帰省しました。<br>\r\nハノイの都会の一方、かたや田舎の年末は人がごった返し、異常なほどの人口増加です。<br>\r\nこれは田舎の年末の買い出しの様子です↓<br>\r\n<br>\r\n<img src=\"http://222.252.25.162/vnhousing/public/assets/blog/d.jpg\"  style=\"width: 600px\" alt=\"ベトナムのお正月(テト)\" /><br>\r\n <br>\r\nこれほど、ハノイは田舎の出身者が多いのかと感じるのと、<br>\r\nこれほど、田舎の人が他の都市で働きに出ているのかと感じられずにはいられません。<br>\r\n<br>\r\nベトナム人のテトの過ごし方は<br>\r\n<br>\r\n年末、大掃除。また、年始の三箇日ほどは店が開いていないため、食料の買出し、仏壇に供えるお供え物(お菓子、果物、花、等々)を買出します。<br>\r\n元日、家族と過ごす。親戚へ挨拶回り。<br>\r\n二日、恩師へ挨拶回り。<br>\r\n三日、友達へ挨拶回り。<br>\r\nこれが基本的な過ごし方ですが。<br>\r\n休みが9日間もあるので、基本的には9日間、母親の田舎、父親の田舎、おじいちゃん、おばあちゃんの田舎へ移動し、挨拶回りという名の、飲み会が続きます。<br>\r\n<br>\r\nベトナム人は食に対して、とても重要視しています。<br>\r\nそのため、こういった飲み会の席、食事の席では<br>\r\n「An di, an di !　(食べて、食べて!)」<br>\r\n「Uong di, uong di !　(飲んで、飲んで!)」<br>\r\nとよく言います。<br>\r\n<br>\r\nどんなにおなかいっっぱい食べていても、<br>\r\n「An di, an di!」<br>\r\nなので、最後はキレてしまう日本人も数人見てまいりました。(笑)<br>\r\nそのため、私は知人とよくこのベトナム人の風習を<br>\r\n「An di攻撃」<br>\r\nと名付けておりました。<br>\r\n<br>\r\nお客様にいかにいっぱい食べておもらう、飲んでもらうことが、“おもてなし”なのですね。<br>\r\n日本にも近いですが、ベトナムの場合は少々しつこい気もしますが、<br>\r\n何はともあれ、この風習になれてしまったのか？私は毎日食べた日本のお正月の餅に匹敵する、ベトナムの餅米ケーキ　バインチュンで3㎏ほど太ってしまいました。(泣)<br>\r\n\r\nまた日本にも近い習慣で“お年玉(Mung Tuoi)”があります。<br>\r\n子供たちや、お年寄りに渡したり、上司から部下にまで渡す場合もあるようです。<br>\r\n<br>\r\nベトナムの文化も、かなり日本と近い部分があり、親近感が湧きますね。<br>\r\n<br>\r\n9日目、ごった返すハノイ行のローカルバスに乗ってハノイに戻ります。<br>\r\nあっという間の９日間の連休が終わってしまいました。<br>\r\n<br><br>', 'seolink', 'ja', NULL),
(4, 1, 'はじめに', 'ベトナムハウジング　畑野と申します。<br>\nベトナム歴は8年目に入りまして、ベトナムでの生活も色々と経験してまいりました。<br>\n現在はベトナム人の主人と、息子４歳と共にハノイで生活しております。<br>\n<br>\nさて、弊社ベトナムハウジングは設立5年目の不動産会社です。<br>\nこの度、ウェブサイトをリニュアルし、ブログを始めることとなりました。<br>\n<br>\nベトナムでの生活は、色々と日本とは異なることも多く、そういった生活の違い、文化の違い、住宅事情の違い、等々を皆様に発信し、ベトナムを理解していただき、またベトナムを楽しんでいただければと思っております。<br>\n<br>\n初回にあたり、ベトナムハウジングの会社紹介を少々させていただきたいと思います。<br>\n<br>\nベトナムハウジング社は主に<br>\n・サービスアパート、マンション、一戸建ての賃貸仲介<br>\n・オフィス物件、SOHOの賃貸仲介<br>\n・不動産売買仲介<br>\n・賃貸管理、建物管理<br>\n・サービスアパートの運営<br>\n・サービスオフィスの運営<br>\nをおこなっております。<br>\n<br>\n日本人のお客様を主にした不動産会社としては老舗の会社です。<br>\n<br>\nCEOのHungは日本語が堪能で、またローカルの不動産業界にも強いため、そういった圧倒的な地域情報量、またベトナムの国は人と人との繋がりが強いため、こういった関係者のコネクションが弊社の強みとなっています。<br>\n<br>\nまた弊社サービスにつきましては、<br>\n１、	仲介手数料、更新手数料無料<br>\n２、	ご入居～ご退去までのアフターサービスいたします。<br>\nカスタマーサポートセンターがお客様の問題を日本語、または英語で迅速、速やかに解決致します。<br>\n※仲介手数料につきましては一部、サービスオフィス、店舗等々のご紹介では発生いたしますので、ご注意ください。<br>\n<br>\nベトナムに初めてご赴任される方、また帯同ご家族の方にはベトナムへの生活に不安があるかと思います。<br>\nベトナムに住み馴れている方でもやはり生活面でトラブルあるもの。<br>\n弊社はそういったお客様方を全面的にサポートさせていただきます。<br>\n<br>\nまた弊社では１年に２回、「ベトナム賃貸物件情報」という雑誌を発行しております。お近くの日本食レストラン等々で入手可能でございます。<br>\n(当ウェブサイトからもご覧になれますので、是非ご覧ください。)<br>\n<br>\n弊社もこれまでの不動産業の経験を活かし、これまでたくさんの皆様の生活のサポートをさせていただいております。<br>\nそしてこれからもお客様を第一に弊社一同頑張って参ります。<br>\n<br>\n<img src=\"http://222.252.25.162/vnhousing/public/assets/blog/e.jpg\" style=\"width: 600px\" alt=\"弊社スタッフ一同\" /><br>\n<strong>弊社スタッフ一同。</strong><br>\n<br>\nベトナムの不動産のことならベトナムハウジングに是非お任せください！！<br>\n<br>\n', 'seourl', 'ja', NULL),
(7, 2, 'Tet Holiday in Vietnam', 'This is an introduction about Lunar New Year (namely Tet) in Vietnam.<br>\r\n<br>\r\nTet bases on the lunar calendar, which usually has the date falling at the end of January or the beginning of February, because of the use of lunar calendar in Vietnam. <br> <br>\r\nIn this year, Tet started on 8th February. In Lunar New Year Eve, as a rule, Vietnamese people will have 5 days off work. However, it was extended to 9 days from 6th February to 14th February (meaning 28th December to 7th January according to the lunar calendar) in this year, because it included 4 days of two weekends.   <br> <br>   \r\nVietnam is considered as one of the countries, which having a few traditional holidays in the world. Therefore, it is such a precise time, when Vietnamese people and foreigners can come back to their hometown. It is recorded as a mass immigration in Vietnam same with China. <br> <br>\r\n It is the fact that the working progress becomes slowly during one month before and after Tet holiday, due to the landlord being in preparation to Tet including the bustle of shopping, decorating the home and New Year Eve Party.<br> <br>\r\nIt pushes our company into difficulty since April is the busiest month all the year that there are many recruitments and human exchanges from Japanese companies. It leads to searching apartments for new Japanese staffs.   <br> <br>\r\nThere are many people who want to sign the contract before Tet in order to enjoy their holiday. There are many people who want to quickly find their new apartment after Tet holiday. We understand and sympathize with our customers. Therefore, we try our best to keep in touch with landlords. <br><br>\r\nIt cannot be denied that Tet is the most important traditional holiday to Vietnamese people. <br> <br>\r\nOn the other hands, it shows another view of Hanoi. <br>\r\n<br><br>\r\nIn the end of year, <br> <br>\r\nDuring one week before 6th February and on the first day of a new year, the number of office staffs reduced by half, although there are 20 office staffs in a normal day. <br> <br>\r\nOn 5th February, there were only 3 staffs as a below picture.  <br>\r\n<br>\r\n<img src=\"http://222.252.25.162/vnhousing/public/assets/blog/a.jpg\" style=\"width: 600px\" alt=\"Tet Holiday in Vietnam\" /><br>\r\n <br>\r\nThere are a few people travelling in the city that are known as an unbelievable view in a normal day.  <br>\r\n<img src=\"http://222.252.25.162/vnhousing/public/assets/blog/b.jpg\" style=\"width: 600px\" alt=\"Tet Holiday in Vietnam\" /><br>\r\n<br>\r\nVietnamese people buy blossom flowers to decorate for their home.  \r\n<br>\r\n<img src=\"http://222.252.25.162/vnhousing/public/assets/blog/c.jpg\" style=\"width: 600px\" alt=\"Tet Holiday in Vietnam\" /><br>\r\n <br>\r\nWe can see a lot of motorbike driving blossom trees and kumquat trees on the street.    <br>\r\n\r\nThere are some distinctive pictures of Hanoi’s street on Tet holiday. <br>\r\n<br>\r\nTo me, Tet is an opportunity to travel to my husband’s hometown – Hoabinh city. <br>\r\nIn these days, conversely, the number of people swiftly increases in the countryside.    \r\n<br>\r\n<br>\r\n<img src=\"http://222.252.25.162/vnhousing/public/assets/blog/d.jpg\"  style=\"width: 600px\" alt=\"Tet Holiday in Vietnam\" /><br>\r\n <br>\r\nAlthough there are many people being born in the countryside area, but it makes me feel that Hanoi is their hometown because of normally observing on normal working days.  <br>\r\n<br>\r\nHow do Vietnamese people celebrate their Tet holiday?<br>\r\nIn order to welcome Tet holiday, they make their house tidy up in the end of the year. Moreover, almost all shopping centers and supermarkets close during 3 beginning days of year. Therefore, people should buy food, Blossom trees, sweets and fruits to prepare their Tet holiday before.   <br>\r\n<br>\r\nThe first day of Tet holiday is the day for family and close relatives.<br>\r\nThe second day is a day for teachers. <br>\r\nThe third day is a day for friends.<br>\r\nIt is the normal habitats of Vietnamese people.  <br>\r\nThere are many people celebrating their holiday by travelling to their hometown so as to gather with their parent as well as grandparents and to hold New Year parties because we have 9 days off work in this year. <br>\r\n “Eat and drink” is also one of the most important things to Vietnamese people. <br>\r\n<br>\r\nLet’s eating!<br>\r\nLet’s drinking!<br>\r\n<br>\r\nThey cheer their holidays by eating and drinking. <br>\r\nI saw some Japanese friends when they come to New Year party holding by Vietnamese people, they have a responsibility to keep eating during a party even if they are full enough.   <br>\r\n<br>\r\nTherefore, ‘An di’ is what I and my friends call this habitant of Vietnamese people. <br>\r\n<br>\r\nThis is the way that Vietnamese people want to cheer their party with their inviters. It is similar with Japanese people, but I feel that the Vietnamese people are friendlier than the Japanese ones. In Tet holiday, I eat ‘Banh Trung” – a Vietnamese traditional dish and many sweets instead of Japanese rice cake when I stay in Vietnam. \r\nAnother custom of Vietnamese being similar to Japanese is giving Lucky money to others on Tet holiday.<br><br>\r\nNot only children but also adult, oldster are also received Lucky money. Moreover, the boss also gives Lucky money to their staffs on the first working day.  <br> <br>\r\nI have a passion about the different of culture between Vietnam and Japan. It makes me feel so friendly when I stay here.    <br><br>\r\nI came back to Hanoi by a local coach on the 9th day of Tet holiday.<br><br>\r\nThis is the end of such a long holiday. <br>\r\n\r\n<br><br>', 'seolink', 'en', NULL),
(8, 1, 'Begining', 'My name is Hatano from Vietnamhousing.<br><br>\r\nI have lived and experienced many interest things with my husband and my 4-years-old son for 8 years in Vietnam.<br><br>\r\n Our company started business on real estate sector since 5 years ago. On the occasion of new website launch, we want to share some experiences through this blog.     <br> <br>\r\nWe hope that it can bring some interesting experience about living in Vietnam, which differs from living style, culture and living condition in Japan.  <br><br>\r\nFirst of all, I introduce about Vietnamhousing. <br><br>\r\nThe business sector of Vietnamhousing includes:<br><br>\r\n&nbsp&nbsp&nbsp&nbsp -	Leasing brokerage services for service apartments, apartments and houses<br>\r\n&nbsp&nbsp&nbsp&nbsp -	Leasing brokerage services for offices, house combining with business stores<br>\r\n&nbsp&nbsp&nbsp&nbsp -	Brokerage services for selling and buying real estate<br>\r\n&nbsp&nbsp&nbsp&nbsp -	Management of leasing services and buildings<br>\r\n&nbsp&nbsp&nbsp&nbsp -	Administration and management of service apartments<br>\r\n&nbsp&nbsp&nbsp&nbsp -	Administration and management of service offices<br><br>\r\nWe are a real estate agent with many years of experience cooperating with foreigner customers, mainly Japanese customers. <br><br>\r\nThe executive officer is Mr Hung, who is known as having a good Japanese ability. Another advantage is that we are a local real estate agency, which possesses a plethora of database, builds a strong connection and good relationship with landlords.   <br><br>\r\nBesides, there are some outstanding features of our service, including:<br><br>\r\n&nbsp&nbsp&nbsp&nbsp 1)	No brokerage services fee, no renewal fee to clients<br>\r\n&nbsp&nbsp&nbsp&nbsp 2)	Supporting customer service during leasing contract. The customer service central will instantaneously support customer’s problems by English as well as Japanese. <br><br>\r\nWe understand your concern about living in Vietnam for the first time, living with your family in Vietnam and other issues of clients being familiar with living style in Vietnam. <br><br>\r\nBesides, we release estate magazines providing leasing estate information in Vietnam and send to Japanese restaurants. We also attached the magazine on our company website.  <br> <br>\r\nWith our experience about estate, we always attempt to support our customers to enjoy their lives as much as possible, customer is the most importance. <br><br>\r\n\r\n<img src=\"http://222.252.25.162/vnhousing/public/assets/blog/e.jpg\" style=\"width: 600px; margin-bottom: 5px;\" alt=\"Vietnamhousing’s members\" /><br>\r\n<strong style=\"\">Vietnamhousing’s members.</strong><br>\r\n<br>\r\nTalking about Vietnamese estate, let Vietnamhousing do it!\r\n<br>\r\n<br>\r\n', 'seourl', 'en', NULL),
(9, 3, 'ISNサービスオフィス　キムマーのご紹介', 'ベトナムハウジング　畑野です。<br/>\n<br/>\n4月1日より新年度となり、ベトナム進出を始められる日系企業様もいらっしゃるのでは\nないでしょうか。<br/>\n2015年10月のTPP大筋合意以降、製造業、医療関係の会社様からサービスオフィスの\nお問い合わせを多く受けるようになっております。<br/>\n<br/>\n今日はそういった会社様に最適な弊社が運営しているサービスオフィスのご紹介です。<br/>\n<br/>\nまずサービスオフィスとは...<br/>\n<br/>\n<li>短期間から借りられる</li>\n<li>机、書庫が備わっている</li>\n<li>コピー機、会議室を共有することでコストを抑えられる</li>\n<li>不在時の郵便物の受取を代行してくれる</li>\n<li>現地法人、駐在員事務所の設立をサポートしてくれる</li>\n<br/>\nつまり、少人数からビジネスを開始する会社様の負担を軽減できるオフィスです。<br/>\n<br/>\nそれでは早速、弊社が運営している物件をご覧いただきます。<br/>\n<br/>\nオフィス名：ISNサービスオフィス　キムマー<br/>\n住所：9F, VIT Tower, No. 519 Kim Ma, Ba Dinh district, Hanoi<br/>\n（キムマーのデーウーホテルの向かい）<br/>\n<br/>\n<img src=\"/assets/blog/blog3-1.png\"><br/>\n外観<br/>\n<br/>\n<img src=\"/assets/blog/blog3-2.png\"><br/>\n部屋1<br/>\n<br/>\n<img src=\"/assets/blog/blog3-3.png\"><br/>\n部屋2<br/>\n<br/>\n日本人管理者の早田が常駐しております。<br/>\nほとんどの入居者様は日系企業で、<br/>\n入居企業様のベトナム人スタッフ同士が仲良くなったり、<br/>\n異業種のつながりができるのもサービスオフィスの良いところです。<br/>\n<br/>\nキムマー通りの中心にあり、日本食を中心とした食事、また周辺には日本人向けのサービスアパートも沢山あり、利便性のよいサービスオフィスです。<br/>\n<br/>\nまた他にも、日系、ローカル問わず優良な税務、会計、法律等のサンサルティングファームの紹介も行っております。<br/>\n<br/>\n詳しくはコチラ<br/>\n<a href=\"http://isnoffices.com/\">http://isnoffices.com/</a>\n<br/>\n是非、一度ご見学下さい。<br/>\n', 'seourl', 'ja', NULL),
(10, 4, '長谷工サービスアパート「The Authentic」モデルルーム公開中', '<br>\n創業80年、マンション施工実績59万戸を誇る日本マンション建設最大手の長谷工コーポレーションのサービスアパートが2017年3月より入居開始となります。<br>\n遮音性、断熱性、防露性、防水性、耐久性、安全性の6つの基本性能が充実したベトナムでは初めての「日本のこだわり」を凝縮したサービスアパートです。<br>\n勿論、室内の設備も浴槽と体の洗い場が分かれた日本式の浴室や、窓には網戸、自動換気システム、主要の家電製品もPanasonic製、洗面周りはTOTO製を使用し、ストレスのないプライベートの空間があります。<br>\nサービス面についても長谷工コーポレーションが自社で現場スタッフを採用、教育を行いますので質の高いサービスも実感して頂けます。<br>\nベトナムハウジングでは本物件「The Authentic」の専任の仲介窓口を行っております。<br>\n建物の仕様や設備の性能が分かるモデルルームも絶賛公開中です。<br>\n<br>\n<img class=\"img-responsive\" src=\"/assets/blog/blog_content_new.jpg\"><br>\n\n', 'seo_url', 'ja', NULL);
