(47, 'コザサ', 'aykozasa@neomailbox.ch', '', 'Vistaの3ベットルームを希望しています。小型犬がいます。Vistaはペットについては、オーナー次第と聞いていますが、いかがでしょうか。予算は1500ドル程度まで。今すぐの入居希望ですが、ペットの状況によっては、フレキシブルです。', '2016-03-29 11:00:17', '2016-03-29 11:00:17', NULL, '', 1, 'As soon as possible'),
(48, '若園　雅英', 'masahide_wakazono@nishimatsu.co.jp', '0914514099', '1区、2区、3区で2ベッドルーム、$2500以下で物件を紹介いただけませんでしょうか？\r\n今週の日曜日4月3日に内覧希望です。', '2016-03-31 02:24:50', '2016-03-31 02:24:50', NULL, '西松建設株式会社', 0, '09-04-2016'),
(49, 'Nguyễn Hương Giang', 'nguyen_huong_giang@hondalock-vn.com', '0915278833', 'Chúng tôi muốn xem và cần thuê căn hộ dịch vụ và hoặc căn hộ tư nhân tại tòa nhà Lancaster - Giảng Võ, Hà Nội vào thứ 7, ngày 9 tháng 4.\r\nTôi cần bạn liên lạc lại với tôi ngay để trao đổi chi tiết thông tin.', '2016-04-05 01:50:31', '2016-04-05 01:50:31', NULL, 'Honda Lock Việt Nam', 1, 'As soon as possible'),
