(51, '喜多嶋良介', 'kitajimaexit1will@yahoo.co.jp', '', '今週の土曜日よりハノイに住みます。\r\nＨａｉ　Ｂａ　Ｔｒｕｎｇ付近で、サービスアパートメントを探しています。\r\n予算は、400ドルから850ドルの間で考えています。\r\n狭くてもいいので、できるだけきれいな所を希望しています。\r\n3ヶ月以内での契約でも問題なく、何か物件がありましたら、見学させて頂きたく思います。\r\n宜しくお願い致します。', '2016-04-12 22:06:33', '2016-04-12 22:06:33', NULL, '', 0, '23-04-2016'),
(52, 'Yuzo Oida', 'zk4268@gmail.com', '', 'お世話になります。\r\n\r\n質問です。\r\nこの物件、例えば$700のものを賃貸する場合、初期費用としてはいくら用意すればよいでしょうか？\r\nhttp://www.vietnamhousing.vn/%E4%BD%8F%E5%AE%85/%E8%A9%B3%E7%B4%B0/402/Tran-Quy-Kien%E3%82%B5%E3%83%BC%E3%83%93%E3%82%B9%E3%82%A2%E3%83%91%E3%83%BC%E3%83%88\r\n\r\nお知らせ下さい。\r\n\r\n宜しく御願いします。\r\n\r\n種田（おいだ）', '2016-04-14 23:11:28', '2016-04-14 23:11:28', NULL, '', 0, 'As soon as possible'),
