(54, '唐津周平', 'karatsu.viet@gmail.com', '01254567536', 'アイグローカルリソース社の吉田さんから、情報提供頂き、問い合わせしております。昨日からハノイに赴任して、duy tan通り[caugiay]のホテルに滞在しております。ベトナム携帯電話にメールまたは電話をよろしくお願いします。', '2016-04-23 03:13:33', '2016-04-23 03:13:33', NULL, '', 0, 'As soon as possible'),
