(58, '南　龍', 'southdragon0728@gmail.com', '0906296080', 'Vietnamhousing\r\nご担当者様\r\n\r\n初めまして、南と申します。\r\n現在、以下条件で住めるアパートを探しているのですが、貴社のご紹介物件に該当するものは御座いますでしょうか。\r\nなにとぞご教示くださいますようお願い申し上げます。\r\n\r\n【条件】\r\n賃料：$700～$1400\r\n場所：Hoan Kiem区内　（会社が2 Ngo Quyenにあるため、できるだけ近いところが良いと考えております）\r\n間取り：特に指定なし\r\n滞在：2016年5月中旬より6ヶ月強\r\nその他：猫を飼いたいと思っております。ペット可の物件はありますでしょうか。\r\n\r\n以上です。\r\n\r\n南', '2016-04-23 12:03:17', '2016-04-23 12:03:17', NULL, 'Swing Water Vietnam Corporation', 0, 'Within 1 month'),
