(76, '野島久恵', 'hisachina@gmail.com', '', 'お世話様になっております。\r\nこの度四月よりハノイに赴任してまいりました、野島と申します。\r\n現在は前任者の住んでいた部屋にとりあえずの入居をしております。\r\n入居してみたら、日本人小学校に通うお子さんが全く居ないということがわかり、いい物件が見つかり次第、引っ越しを考えております。\r\n主人の会社の都合上、住める地区も決まっておりまして、現在の住まいのTheGarden(Me Tri)付近か、indochina付近でしたら引っ越し可能です。\r\nある程度遊べる庭やプールが付いている物件が望ましく、今のところインドチャイナを検討しております。\r\n２ベッドか３ベッドで、価格はすべて含めて〜＄1600くらいまでで検討しております。\r\nまずは空き物件の有無、詳しい内容やお部屋の写真等(HPで見られる他にあれば)、メールにて送っていただけたらありがたいです。\r\nお部屋のある棟と階がわかるとさらに嬉しいです。　\r\nまずはよろしくお願いします。', '2016-05-12 09:23:48', '2016-05-12 09:23:48', NULL, '', 1, 'As soon as possible'),
