(79, '渡部亮太', 'ryota.woogle@gmail.com', '60142951575', 'はじめまして、Woogle Holdings SDN BHDの渡部（わたなべ）と申します。\r\n弊社は本社がマレーシアにある、マレーシアとインドネシアでのフードコート事業を主に事業を行っている会社でございます。\r\n\r\nこの度ご連絡させて頂きましたのは、ベトナムのデベロッパーと提携してハイフォンでの都市開発を進めており、\r\n計画区画内のマンションの販売についてご相談させて頂きたく存じ、メール致しました次第でございます。\r\n今月２３、２４日とハイフォンに参りますので、その折に是非とも御社にご挨拶に伺わせて頂ければと思うのですが、\r\nその期間で日本語対応できる方はいらっしゃいますでしょうか。\r\n\r\n急な申し出で大変恐縮ではございますが、ご検討いただければ幸甚でございます。\r\n何卒宜しくお願い申し上げます。\r\n\r\n渡部\r\n\r\n======================================\r\n\r\nRyota Watanabe　/　渡部 亮太 \r\n\r\nWoogle Holdings Sdn Bhd\r\nLot 03-113&114, Berjaya Times Square\r\n1 Jalan Imbi, 55100 Kuala Lumpur, Malaysia\r\n\r\ne-mail  :   ryota.woogle@gmail.com\r\nmobile :   +6014-925 1575\r\nskype  :   ryota.woogle\r\n\r\n======================================', '2016-05-16 11:47:26', '2016-05-16 11:47:26', NULL, 'WOOGLE HOLDINGS SDN BHD', 0, 'As soon as possible'),
