(88, '能脇幸雄', 'yukio-nowaki@fujisash.net', '819017380933', 'ご担当者様\r\n\r\n不二サッシ　海外事業部 牟田口と申します。\r\n弊社　能脇幸雄（ノワキユキオ）が貴物件についてお問い合わせさせていただきたくご連絡いたします。\r\n\r\n具体的な日にちは確定しておりませんが、７月頃から約１ヶ月ほどお世話になりたいと考えており、以下について教えていただけますでしょうか。\r\n(1)詳しい番地\r\n(2)家賃　ＨＰに掲載の家賃に幅がありますが、ちなみに写真の部屋の場合は、１ヶ月おいくらになりますでしょうか。\r\n広さとあわせてお知らせください。\r\n(3)敷金礼金等のその他に発生する費用があれば、詳細をお教えいただけますと幸甚です。\r\n(4)その他注意事項など\r\n(5)同じ地域の他のお進め物件があればその詳細\r\n\r\n能脇は６月に御地への出張の予定があり、その際に日本人の方に詳しくお話をお伺いできればありがたく\r\n日本人の方のご連絡先をお知らせいただけますでしょうか。\r\n\r\nお忙しいところお手数をおかけしますが、どうぞ宜しくお願いいたします。\r\n\r\n牟田口\r\n\r\n\r\n\r\n', '2016-05-31 02:49:10', '2016-05-31 02:49:10', NULL, '不二サッシ', 0, 'Within 2 months'),
(89, '成光　智史', 'satoshi.narimitsu@moririn.co.jp', '0906857188', 'ご担当者様\r\n\r\n下記参照くださいませ。\r\n\r\n目的：ハノイ赴任\r\n入居期間：　2016年07月　1年間以上\r\n入居人数(家族構成)：大人2人　子供1人\r\n希望エリア：\r\n通勤先・通学先：Icon4\r\nその他希望条件など：\r\n家賃$1200~1300(VAT IV不要)\r\n3LDK or 2LDK\r\n新築がベスト\r\nバスタブ必須\r\nロイヤルシティ、インドシナ、その他良いところがあれば紹介ください。\r\n\r\nまた妻と、1歳半の子供がおりますので、セキュリティがしっかりしたところで、\r\n子供が遊べるパブリックスペースがあるところが良いです。\r\n\r\n6月10日~12日の3日間で家族でハノイに行き、部屋探しをしますので、\r\nこの日程でいくつかお部屋紹介お願いしたいです。\r\n\r\nまた効率よく回るためご紹介頂ける物件をメール連絡頂ければと思います。\r\n\r\n以上、何卒よろしくお願い申し上げます。\r\n', '2016-06-01 02:42:44', '2016-06-01 02:42:44', NULL, 'Moririn Vienam co.,ltd', 0, 'Within 1 month'),
