(106, 'miyazaki@dentalsupport.co.jp', 'miyazaki@dentalsupport.co.jp', 'ミヤザキ　ヒロシ', 'ご担当者様\r\n\r\n初めてご連絡させていただきます、\r\n日本の千葉県に本社があります、デンタルサポート（株）の宮崎と申します。\r\n今回ご連絡させていただきましてのは、弊社は今年3月より、Vinmec international Hospital \r\n(Times CIty)と業務提携をさせて頂き、日本人歯科医師を派遣し、現地の歯科の技術指導、及び、歯科診療を\r\n行っております。\r\n御社では、タイムズシティ等のサービスアパートメントをご紹介しているとお聞きしまして、\r\n一度ごあいさつをと思いまして、ご連絡させていただきました、\r\n私、宮崎は、6月28日までハノイに滞在しておりますので、\r\nお忙しいところ、大変恐縮ではございますが、この機会にお会いできるお時間をいただけたら幸いです。\r\n何卒よろしくお願い申し上げます。\r\n', '2016-06-20 08:31:48', '2016-06-20 08:31:48', NULL, '宮崎　浩史', 0, 'As soon as possible'),
(107, '長尾貴之', 'nagao@owndays.co.jp', '+819064287055', 'はじめましてご連絡させたいただいております。\r\n(株)オンデーズの長尾と言います。\r\n7月に弊社運営の店舗1号店が、ホーチミンのサイゴンセンターにオープンいたします。\r\n\r\n下記、弊社の日本Webサイトになります。\r\nhttps://www.owndays.com/jp/ja/\r\n\r\n\r\nそれに伴い、現在入居先を探しております。\r\n\r\n希望としましては、\r\n\r\n・家賃USD1800以下\r\n・2人入居\r\n・サイゴンセンターまで通える距離\r\n・2LDK以上\r\n・トイレ・シャワー付き（できれば、マスタールームには独自のトイレ・シャワー付き）\r\n・エアコン、冷蔵庫、洗濯機・キッチン付き\r\n・Wi-Fi付き\r\n\r\nとなります。\r\n\r\n今回初めての問い合わせになりますので、相場などわからずに問い合わせしています。\r\n\r\nこの値段で希望通りの部屋が探せるか（少し離れても良いですが、サイゴンセンターまで通える距離）\r\n教えていただければと思います。\r\n\r\nまた条件に合致する物件があればご提案いただければと思います。\r\n\r\nよろしくお願いします。\r\n\r\nサイゴンセンターの住所は下記の通りです。\r\nSaigon Center, 65 Le Loi Boulevard, Dist.1 Ho Chi Minh City', '2016-06-27 09:49:15', '2016-06-27 09:49:15', NULL, '(株)オンデーズ', 0, 'As soon as possible'),
