(117, '馬場　倫子', 'smile9029@viola.ocn.ne.jp', '', 'ご担当者様\r\n\r\n家族四人（夫婦、中１（女）、小５（女））と、小型犬１匹で住めるサービスアパートを２区、7区、ビンタン区で探しております。間取りは３ベッドルームもしくは２ベッドルームを希望します。ただし、２ベッドルームの場合は１つのベッドルームはシングルベッドが２つあると良いです。賃料は1500USDぐらいで考えております。日当りと風通しは良い方がいいのですが、高層階は希望しません。娘達が日本人学校に通うことになると思いますので、日本人学校の送迎バスが停まるアパートもしくはその近くのアパートですと助かります。インテリアは木を使用した落ち着いた感じより明るいお洒落な感じが好みです。\r\nいろいろ無理な希望ばかりで恐縮ですが、もし条件に合う物件がございましたらご紹介下さい。\r\nよろしくお願い致します。', '2016-07-13 08:59:16', '2016-07-13 08:59:16', NULL, '', 1, 'Within 3 month'),
