(123, '黒澤千晶', 'kokuro0722@gmail.com', '', '初めまして。黒澤と申します。\r\nHilton garden in の近くにあります「Momiji apart」について、貴社の問い合わせ先の張り紙を見て問い合わせしております。\r\n単身女性なのですが、8月7日あたりから2か月の契約は可能でしょうか？\r\nまた、以前他の不動産会社を通して、小さ目の部屋を内見させて頂いたのですが、その部屋に入居することは可能でしょうか？\r\nどうぞご検討、宜しくお願い致します。\r\n', '2016-07-13 14:57:45', '2016-07-13 14:57:45', NULL, 'アジア開発銀行インターン', 1, '07-08-2016'),
(124, '長岡駿介', 's-nagaoka@ishin1853.co.jp', '6594262562', 'ISN Corporation　ハノイ本店\r\nご責任者様\r\n\r\nイシンSG（ヤッパン号）の長岡と申します。\r\n何度かご連絡を差し上げており、恐縮です。\r\n\r\nこの度、ヤッパン号の有料掲載（月額課金）ではなく、\r\n★無料掲載（お問い合わせ課金）をご相談したく、連絡させて頂きました。\r\n\r\n事業開始4年目を迎えた当サイト「ヤッパン号」では、\r\n今年より、業界に特化した特集ページを国毎に開設しています。\r\n\r\n「ベトナムの不動産」特集も直近でリリースを予定しており、\r\nその中で、ベトナム不動産の専門家の皆様もご紹介させていただく予定です。\r\n\r\n==========================================\r\n▼ヤッパン号TOP\r\n┗ http://www.yappango.com/\r\n\r\n▼特集ページのイメージ\r\n┣ 「インドネシアの不動産」の場合\r\n┗ http://www.yappango.com/keywordpage/indonesia_generalestate.html\r\n==========================================\r\n\r\nそこで、ぜひ御社にもベトナム不動産特集ページにご登場いただき、\r\n「お問い合わせ1件に対する従量課金プラン」という形で\r\nお付き合いさせて頂けないか、ご相談させて頂ければと思っています。\r\n\r\nお問い合わせ内容を見た上で、対応可否のご選択いただき、\r\nご対応する場合のみ課金させていただく仕組みですので、\r\nリスク低く、お付き合いいただけるのではと考えています。\r\n\r\nもし少しでもご興味いただけるようでしたら、\r\n私が8月8日（月）～11日（木）にハノイ出張を予定しておりますので、\r\nその際に御社に伺い、詳細を説明させて頂ければと思っております。\r\n\r\nお忙しい中に恐れ入りますが、ご検討のほど、よろしくお願いします。\r\n良いご縁に繋がれば嬉しい限りです。\r\n\r\n\r\n　　　　　　　　　　　　　　　　　　　  ISHIN SG PTE. LTD.\r\n　　　　　　　　　　　　　　　　　　　　長岡 駿介\r\n\r\n～追伸～\r\n\r\n私たちイシングループは、日本で数万名の経営者に流通する情報誌\r\n「経営者通信」や、自治体向けの情報誌「自治体通信」を発刊しています。\r\n\r\nその顧客である日本経営者の方々が海外展開に積極的であるため、\r\n2012年12月よりシンガポールに現地法人を設立。[海外進出に積極的な\r\n日本の経営者] と [世界各国の専門家] を結びつけるWebポータルサイト\r\n「ヤッパン号」を運営しています。\r\n\r\n現在、ヤッパン号では月間26,000名の方々にアクセスいただき、\r\n1,000社以上の専門家の方々を紹介させて頂いております。', '2016-07-25 16:11:12', '2016-07-25 16:11:12', NULL, 'ISHIN SG PTE LTD', 0, 'As soon as possible'),
