(143, '能戸 智恵美', 'notoc@qunie.com', '0911560026', 'お世話になります。ベトナム人の夫と二人入居、予算は光熱費込みで1000ドルで探しています。サービスアパートではないところがよいです。家具もなくても良いです。\r\n以下、望ましい条件を提示させていただきます。\r\n空港、レタントンにアクセスのよいところ\r\n水回りがきれいで排水がしっかりしているところ\r\n害虫が出ない\r\n築5年以内\r\n50平米以上\r\n間取りは1ldkくらいでよい\r\nジムあり\r\nオーナーの人柄が良い(修理など率先してやってくれる)\r\n居間に窓がありそこそこ日が入る\r\n\r\nどうぞよろしくお願いします。', '2016-08-10 15:26:37', '2016-08-10 15:26:37', NULL, 'Qunie', 1, '10-01-2016'),
