(150, '和山正人', 'wayama1125@yahoo.co.jp', '', '10月から入居可能な一人暮らし用のアパートを探しています。\r\nDA KAO周辺でキッチンとWi-Fiが利用できるのが最低条件です。家賃の予算は1ケ月500USD以下のものを探しています。\r\n良い物件がありましたら是非紹介してください。\r\n宜しお願いします。', '2016-08-14 15:44:08', '2016-08-14 15:44:08', NULL, '', 0, 'Within 2 months'),
(151, '黒田　学', 'manabukrd@hotmail.com', '', '9月11日(日)から翌3月10日までハノイ師範大学（下記住所）に客員教授として単身赴任します。\r\n大学近くで、安全で静粛な部屋（キッチン、洗濯機、バスタブつき）を探しています。\r\n予算は、７００～８００ドル程度です。適当な物件をご紹介頂けますか？\r\n大学近くのPoonsa Apartmentのような物件です。\r\nまた、契約までの手続きについてもお教えください。よろしくお願いいたします。\r\nTrường Đại học Sư phạm Hà Nội\r\n Địa chỉ: 136 Xuân Thủy - Cầu Giấy - Hà Nội', '2016-08-14 19:18:16', '2016-08-14 19:18:16', NULL, '立命館大学', 0, '11-09-2016'),
(152, '堤真理子', 'tsutsumi.vn@gmail.com', '0904881543', 'はじめまして。堤（つつみ）ともうします。\r\n現在ハノイのGolden Westlakeに住んでおりますが、\r\nオーナーが部屋を売却することになり、物件を探しております。\r\n現在の部屋の契約満了日は１０月１６日ですが、９月中に引っ越す予定にしており、現在のオーナーにも\r\nその旨を連絡済みです。\r\n子供（１４歳）の学校（Hanoi Inernational School)や主人の会社の送迎車の都合で、現在住んでいる地域がベストです。\r\n以下の条件のいずれかにあう物件がございましたら、ぜひご紹介いただきたく思います。\r\nよろしくお願いいたします。\r\n\r\n①ベッドルームが広めの２ベッドルーム\r\n②納戸付きの２ベッドルーム\r\n③３ベッドルーム\r\n④”家賃1500US$”または”サービスアパートで1700-1900US$前後”の物件\r\n\r\n堤真理子', '2016-08-16 02:22:00', '2016-08-16 02:22:00', NULL, '', 1, 'Within 1 month'),
