(155, '丸岡　卓郎', 'maruoka.t@honestvietnam.com.vn', '0949800255', '初めてメールさせて頂きます。\r\n小職、ハノイ在住9年(妻ベトナム人)となっているのですが、現在、ハノイ市内で不動産購入を考えております。\r\n現在検討しているのは、DiscoverycomplexとかMONCITY(2期工事目)など、他にも良好物件があれば考えていきたいと思っています。\r\n\r\nそこで、購入にあたっての色々な問題について情報収集したくご連絡をさせて頂きました。\r\n・購入資金の送金について\r\n・不動産業者から購入する際の問題点、入居保証、レッドブックの入手について(共同名義が可能かどうか、現在の状況)\r\n・銀行から資金調達が可能かどうかまた、その利率は10％以上かどうか(当方テンポラリレジテンスカードは持っております)\r\n・不動産業者から購入する場合、一括で全額払う必要があるのかどうか、ローン等は可能なのかどうか。\r\n・その他問題点等\r\n調査等に費用が掛かる様であればそれは相談させて頂きたいと思いますが、まずは、情報収集させて頂きたく、よろしくお願いいたします。', '2016-08-25 07:54:42', '2016-08-25 07:54:42', NULL, 'HonestVIETNAM CO.,LTD', 0, 'As soon as possible'),
(156, '島原友紀', 'shimayuki3@gmail.com', '01225586101', '初めまして、wingoodの島原と申します。\r\n\r\n現在、18bis NTMKに住んでいるのですが、9月末に事務所を移転することになり、住居の引っ越しも考えています。\r\n\r\n新しい事務所の住所は\r\n88 AB Trần Huy Liệu ,P.15 Q.Phú Nhuận ,THCM\r\n\r\n新事務所周辺で、探しています。\r\n700USD以内、1ベットルーム、キッチン、バスタブ、エレベーター付き、\r\n買い物しやすいよう、スーパーが近くだと嬉しいです。\r\n\r\n良い物件があれば、おすすめいただけませんでしょうか？\r\nよろしくお願いいたします。', '2016-09-01 02:27:27', '2016-09-01 02:27:27', NULL, 'wingood', 1, 'As soon as possible'),
(157, '江里口由紀', 'yukieriguchi@yahoo.co.jp', '817015502570', 'はじめてメールさせていただきます。\r\n江里口と申します。東京で会社員をしつつ、不動産投資をしており、関東圏で区分、一棟もの、両方持っておりますが、今年から目を海外にも向け始め、\r\nベトナムの不動産も検討中です。\r\nシルバーウィークにホーチミンからハノイまで一週間で旅行する予定で、9/17夜にホーチミン入りします。\r\nもし可能でしたら9/18にいくつか投資物件を見せていただくことは可能でしょうか。または事務所に伺ってお話をうかがえますか。\r\n\r\nご連絡お待ちしています。\r\n江里口由紀\r\n', '2016-09-07 03:21:28', '2016-09-07 03:21:28', NULL, '', 1, 'As soon as possible'),
(158, '高岡', 'sample482000@yahoo.com', '', 'こんにちは。\r\n私は現在日本に住んでいて、キャピタル狙いの海外不動産投資を考えています。\r\n今のところ、日本にはアパートメントを一棟所有しています。\r\n\r\nベトナムではホーチミン、ハノイ、ダナンで探しています。\r\n売買価格は５００万円ほどが希望です。\r\n希望価格は一般物件と比べると安いですが、最初の海外不動産なのでこのぐらいからスタートしていこうと思います。\r\n現在キャッシュ（自己資金）は４００万円ほどあります。\r\n\r\n物件情報ありましたらご連絡ください。メールでお願いします。\r\n良い物件ありましたら、２０１６年１２月２９日〜２０１７年１月３日にかけて、現地に視察にも行けます。\r\nよろしくお願いします。', '2016-09-08 10:39:11', '2016-09-08 10:39:11', NULL, '', 0, 'As soon as possible'),
