(167, '田口順子', 'taguchi@katahira.com', '', 'JICAミッションで建設省に短期的に勤務している者です。現在別の物件に滞在中ですが、より快適な物件を探しています。建設省に徒歩通勤でき、ルームクリーニングなどが週3回、BBC放送対応、静かで落ち着く環境であればと思っています。賃料の目安は800～850米ドル/月で、通常、29泊程度になります。次回の来訪予定は11月半ばからのほぼ1ヶ月です。宜しくお願い致します。', '2016-10-05 00:33:03', '2016-10-05 00:33:03', NULL, '', 1, 'Within 1 month'),
(168, '茂呂ブレシ', 'blessy101@gmail.com', '', '初めまして。\r\n茂呂と申します。\r\n\r\n年末までに家族4人で暮らせる家を探しています。\r\n希望は下記になります。\r\nー　2区\r\nー　2ベッドルーム、2バスルーム（浴槽付き希望）\r\nー　2LDK\r\nー　バイクの駐車場あり\r\nー　ベランダあり\r\nー　雨季の時期に家の前が水没しないこと\r\nー　価格＄３００～＄５００\r\n\r\n条件として厳しいところがあればアドバイスいただきたいです。\r\n以上、よろしくお願いします。\r\n', '2016-10-12 15:48:27', '2016-10-12 15:48:27', NULL, '', 0, 'Within 2 months'),
(169, '山之内　咲生', 'neco6si7@outlook.jp', '', '　はじめまして、山之内と申します。10月の下旬ごろにベトナム語留学でハノイに行くのですが、\r\nそのためのアパートを探しており、このサービスアパートが気になったので問い合わせました。\r\n　ある程度の内装の様子やサービス内容は写真や説明書きから分かったのですが、\r\nどのような電化製品が備え付けられているのか、鍋や食器などの調理器具も備え付けられているのかも\r\n知りたいです。あと、何階建てでどの階の部屋が現在空いているのでしょうか？\r\n　\r\n　サービスのことなのですが、賃料の中に含まれているハウスキーピングを外すことは可能でしょうか？\r\nランドリーも洗濯機が備え付けであるのなら自分でしたいのですが、乾きにくい時期だけお願いすることとか\r\nできるのでしょうか？\r\n\r\nお手数おかけしますが、お返事お待ちしております。\r\n\r\n山之内　咲生\r\n　\r\n\r\n\r\n', '2016-10-14 08:25:10', '2016-10-14 08:25:10', NULL, '', 1, 'As soon as possible'),
