(172, '永田友一', 'y-nagata@asti.co.jp', '0906212300', '弊社がノイバイ空港近く北部の工業団地にあるため、Kim ma、Linh Lang付近（出来れば北側）でニャッタン橋にアクセスが良いアパートを探しています。\r\n条件\r\n単身\r\n上限1,000ドル\r\nバスタブ（お湯がはれると嬉しいです。）\r\nKim ma、Linh Langからタクシーで10分圏内\r\n\r\n以上、何件か情報頂けると助かります。', '2016-10-24 09:16:12', '2016-10-24 09:16:12', NULL, 'ASTI', 0, 'Within 2 months'),
