(174, '墨谷桃子', 'momoko@vegasegamingclub.com', '01217898858', 'ご予算: 1000 USD ~ 1000 USD \r\n入居希望日: 2016/12/10 \r\n内容: 現在ハノイ、コウザイ地区のタンロンナンバーワンに住んでおります。来月に更新なのですが、引っ越しを考えております。職場がグランドプラザハノイホテルなのですが、タイ湖とグランドプラザの間にあり、2ベットルーム以上でセキュリティのしっかりしている物件はありませんでしょうか。予算は会社の決まりで１０００ドル以内（レッドインボイス込み）です。宜しくお願い致します。部屋の掃除や光熱費は別に会社から出ますので、別のほうが良いです。 \r\n', '2016-11-07 05:11:53', '2016-11-07 05:11:53', NULL, 'Grand Plaza Hanoi', 1, 'As soon as possible'),
