(176, '桜井達郎', 'sakurai@ueno-systec.co.jp', '+81-9088131266', '初めまして。時期は未定なのですが、今週12日（土）（時間問わず）ハノイの物件を拝見させていただければと思っています。\r\n私の仕事場がハイフォンメイン。幼稚園に通う息子がいること。予算はUS1500程度。\r\nイオンの近くとハイフォンへ向かう高速の近くの物件を見たいと思っています。\r\n連絡お待ちしております。', '2016-11-07 05:55:32', '2016-11-07 05:55:32', NULL, '㈱ウエノシステック', 0, 'Within 1 month'),
