(180, 'グェン', 'n.nguyen@toabo.co.jp', '', 'お世話になります。\r\n弊社はハノイに駐在員事務所を設立する予定があり、現在事務所候補の物件を探しています。\r\n下記のいくつかの物件条件を考えています。\r\n\r\n1.面積：10－20ｍ2\r\n2.賃貸料：～5万円まで、～10万円まで、～15万円まで　\r\n　（比較したいのでいくつかの物件を紹介して頂きたいと思います）\r\n3.場所：ハノイ、\r\n4.周りの環境：オフィス街（企業たくさん集まっている所）、食事できる所がある（可能であれば）\r\n5.日本企業の駐在員事務所として登録できる所（ちゃんとしているところ）\r\n\r\nもし貴社に依頼する場合、紹介料がいくらか教えていただけますか。\r\n\r\n恐れ入りますが、よろしくお願いいたします。\r\n', '2016-11-28 01:57:58', '2016-11-28 01:57:58', NULL, '東亜紡織株式会社', 1, 'As soon as possible'),
(181, '柴　敏康', 't-shiba@asti.co.jp', '0126 828 6666', 'ご担当者様\r\nアパートを探しております。\r\n私は現在、93 Lo Duc, Kinh Do Towerに住んでいますが、\r\n12/6で更新が切れ、その後オーナーさんが売りに出すとの事で更新ができなくなってしまいました。\r\n\r\nそこで緊急でアパートを探しております。\r\n例えば、ホアビングリーン（BaDinh区）で即入居可能は部屋はありませんでしょうか？\r\n1000USD以下で探しております。\r\nもし、可能でしたら本日夕方にでも物件を拝見できれば助かるのですが。\r\n\r\nお手数お掛けしますが宜しくお願い致します。', '2016-12-02 03:31:45', '2016-12-02 03:31:45', NULL, 'ASTI株式会社', 0, 'As soon as possible'),
(182, 'YOSHIOKA RYOSUKE', 'ryosuke.yoshioka@lixil.com', '0934532598', '初めまして吉岡といいます。宜しくお願い致します。\r\n現在既にLing Lanh通りに住んでいますが、妻が来る2月頃に転居するアパートを探しています。\r\n条件としましては、\r\n・家賃2500ドル以下（光熱費、ネット、ハウスキーピング、税金など全て込みで）\r\n・ガスコンロ\r\n・通勤車の通行沿い（Ling Lanh～Kim ma Thuong~Lieu Giai~Van cao~Hoang Hoa Thum～Phan Dinh Phung~Tran Nhat Duat~Cau Chuong Duong~~~Office(Duong Xa Commune)であるLing LanhからChuong Duong橋の間\r\n・子供はいません\r\n・入居は最速で2/6です、最大で1ヶ月遅れる可能性もあります\r\nです。\r\n併せて1つ質問させてください。\r\n・こちらの文化がわからないのですが、ガスコンロは付いていなくても街で購入して使用することはできるのでしょうか？\r\n\r\n以上、連絡お待ちしております。\r\n\r\n吉岡', '2016-12-04 12:06:13', '2016-12-04 12:06:13', NULL, 'LIXIL', 0, '06-02-2017'),
