(185, '喜多嶋良介', 'kitajima@b-company.jp', '01253052358', 'ご担当者様\r\n\r\nお世話になっております。\r\nB&Companyの喜多嶋と申します。(ISN Homeに住まわせて頂いております）\r\n\r\n弊社のクライアントが今月ハノイ視察を行う予定なのですが、その際、レストラン物件をいくつか見学したいと考えております。そのため、レストラン物件を紹介して頂ける不動産業者様を探しているところです。\r\n\r\nちなみに、現地ローカル企業との合弁形態で日本食レストランの運営を考えており、今回の視察日程は、12月19日～23日となります。\r\n\r\n希望物件としましては、\r\n	多数のフロアから成るものではなく、1フロアが広い物件\r\n	席数は、70席以上\r\n	賃貸料の上限としては、4500ドル（月）\r\n	ホアンキエム湖周辺　（ホアンキエム湖周辺がベストだが、繁華街であれば、一応検討可）\r\n	できれば、天井が高い方がいい\r\n以上となります。\r\nもし、上記項目に当てはまる物件がいくつかあるようでしたら、写真とともに情報をお送り頂けないでしょうか。（クライアントに事前に確認したいため、写真もできればお願い致します）\r\n\r\nまた、クライアントは、来年にベトナム進出することがほぼ決定しており、今回の視察で以下の業者を訪問したいと考えておりまして、同時に探している状況です。そのため、もし以下の業者の中で、日系、ローカル問わず良いところをご存知でしたら、お忙しいところ恐縮ですが、連絡先等をお教え頂けないでしょうか。（できれば、価格帯は安い方がいいです）\r\n\r\n①厨房機器業者②内装業者③セキュリティ業者④家具造作業者⑤厨房備品（鍋・釜等）⑥店舗備品業者（箸・グラス・消耗品等）⑦卸売業者⑧ユニフォーム業者⑨レジ業者\r\nもしご存知でかつご紹介して頂けるのであればという形でお聞きしておりまして、物件のみご検討頂いてももちろん構いません。お忙しいところ大変申し訳ございません。\r\n\r\n長文になり申し訳ございませんが、宜しくお願い致します。\r\nB&Company喜多嶋\r\n', '2016-12-16 10:22:00', '2016-12-16 10:22:00', NULL, 'B&Company Vietnam', 0, '16-012-2016'),
