(233, '高柳　貴年', 'tatyan0914@gmail.com', '09042693065', '以前メールしたのですが、メールは届いているのでしょうか？\r\n\r\n2月１日よりベトナム出向が決まり、ハノイに居住します\r\n家族帯同を予定しており、４人で居住予定です。\r\n\r\n１２月にベトナムに来た際に、インドチャイナ、Thang Long No.1の物件を少し見ています。\r\nそこで、Thang Long No.1物件を探しています。\r\n\r\n3ベットルームから4ベットルームの物件を探してもらえないでしょうか。\r\n出来れば、先行で物件情報を頂き、2月に赴任した際に物件を見せてもらいたいと思っています。\r\n\r\nお手数ですがよろしくお願いします', '2017-01-08 14:08:50', '2017-01-08 14:08:50', NULL, '浜名湖電装（HDVN）', 0, 'Within 2 months'),
