(237, '寺澤 明子', 'd1dgucr7@yahoo.co.jp', '09042630907', 'はじめまして。\r\n6か7月よりハノイでの入居を希望しております、テラサワと申します。\r\n希望としては、50平米以上で1000ドルくらいには抑えたいと思っています。\r\n場所は、ホアンキエム、キムマーより南下しないくらいで、静かなところがいいです。\r\n息子がBISに通う予定で進めていますので、そちら方面ですと、まだ空気もいいのかと…\r\n3月後半にハノイ入りする予定を立てていますので、その際にいくつか物件も内覧できたらなと考えております。\r\nどうぞよろしくお願いいたします。', '2017-01-10 01:39:37', '2017-01-10 01:39:37', NULL, '', 1, 'Within 6 months'),
