(241, '沼畑芳典', 'sdj2709rjss@yahoo.co.jp', '0948923072', 'ハノイ市内からの引っ越しです。\r\nハイバーチュン近辺で、400USD~600USD、1Bedroomを探しています。\r\n\r\n特に下記の物件興味あります。\r\nHN00166　HN00057　002432　002428\r\n\r\nまた下記の物件も可能な限り見学したいです。\r\nHN00163　HN00281　HN00271　HN00270　HN00268\r\n002434　HN00174　HN00286　HN00171\r\n\r\n\r\nよろしくお願いします。\r\n', '2017-01-16 19:45:20', '2017-01-16 19:45:20', NULL, '', 0, '08-02-2017'),
(242, '佐藤萌美', 'me_o1227_jayv@yahoo.co.jp', '', 'ハノイ駅周辺、勤務先（Dao Duy Anh str）からタクシーで15分圏内、1BR、800USDで探しています。\r\n希望は新築または築浅、高層階、バスタブ有り、24時間警備、タクシーが入れるところ等です。\r\nこの物件が気になっています。他にも似た条件のものがあれば、ご紹介お願いします。\r\n宜しくお願い致します。\r\n', '2017-01-18 08:09:03', '2017-01-18 08:09:03', NULL, '', 1, 'Within 2 months'),
(243, '石谷　学（康子）', 'hellopiggyboo@yahoo.co.jp', '0', '２月１１日より６月１７日まで、夫婦二人で滞在する住居を探しております。\r\n\r\n１ベッド、１バスルーム以上\r\n予算：５００～１０００USD/month\r\n広さ：５０㎡以上\r\nその他条件：家具付き・wifi・バスタブ・洗濯機\r\n\r\n自転車通勤のため、場所は職場から約４キロ圏内\r\n職場アドレス：\r\nCIAT　Asia\r\nAgriculture genetics institute\r\nVien Di Truyen Nong Nghiep\r\nAddress: KM 2 - Đường Phạm Văn Đồng - Từ Liêm \r\n２０１４年より、毎年数か月ハノイに滞在しておりますので、地理はおおよそ理解しております。\r\nバスストップが徒歩圏内にあると助かります。\r\n希望としましては、こちらのPham　Huy　Thong地区が理想的。もしくはタイ湖西部のVeHo、LacLong Quan周辺も良いかと思っています。\r\n私たちの希望に合う空物件はありますでしょうか？\r\nありましたら、ハノイ到着は９日ですので、１０日に拝見して１１日入居を希望しています。\r\n以上、よろしくお願いいたします。', '2017-01-22 05:21:41', '2017-01-22 05:21:41', NULL, 'CIAT(International center for tropical agriculture)', 0, '11-02-2017'),
