(259, '鈴木俊夫', 'mu2525ling@gmail.com', '08082574130', '3月中旬から末頃に入居希望で、2月16日に見学に一度見学できたらと考えています。\r\n予算は2000ドルです。\r\n光熱費やネットなど諸費用込みの上限額です。\r\n家族4人で3LDKは欲しいと考えています。\r\n日本人学校と幼稚園のバスまたは徒歩で各々通える場所であり、徒歩圏内に近所の子供が遊ぶ場所があると良いです。その他要望もございますが、まずはよろしくお願い致します。', '2017-02-08 01:39:26', '2017-02-08 01:39:26', NULL, 'ベトナムNGK', 0, 'Within 1 month'),
(260, '神田', 'kanda.kei@tokyoconsultinggroup.com', '01644104216', '初めましておはようございます。\r\n\r\nわたくし東京コンサルティンググループ\r\nHanoi officeに勤務しております神田と申します。\r\n\r\n先日、Hanoi到着し\r\n出来るだけ早く現地の物件を抑えたく\r\n今回御社に連絡を差し上げました。\r\n\r\n下記に物件に求める条件をまとめましたので\r\nお手数ですがご確認の程宜しくお願い致します。\r\n\r\n\r\n＜求めている条件＞\r\n・無線Lan(Wi-Fi)\r\n・ランドリー\r\n・水道代（可能であれば）\r\n・24時間セキュリティー\r\n・インターネット\r\n・ハウスキーピング（可能であれば）\r\n・冷蔵庫\r\n・キッチン\r\n・1BR \r\n・※本社からタクシーで15~20分程度の距離にある物件\r\n※5th floor,kinh Do building,292,Tay Son Str.,Dong Da Dist,Hanoi,Vietnam\r\n\r\n＜予算＞\r\n・＄350~550\r\n\r\n又、現在「Hoang Ngoc Phachサービスアパート」に興味を持っております。\r\n\r\n上記の物件からタクシーを使用した場合\r\n本社まで15~20分程度で通うことは可能でしょうか？\r\n\r\nお忙しい中大変恐縮ですが\r\nご確認の程宜しくお願い致します。\r\n\r\n\r\n神田\r\n\r\n', '2017-02-08 01:43:27', '2017-02-08 01:43:27', NULL, '東京コンサルティンググループ　Hanoi office', 0, 'As soon as possible'),
(261, '神田', 'a3115119.kanda@gmail.com', '01644104216', '【※再送】\r\n\r\n※a3115119.kanda@gmail.com\r\n→上記のメールアドレスに送信して頂けると幸いです\r\n\r\nー以下内容ー\r\n\r\n初めまして\r\n\r\n私東京コンサルティンググループ\r\nハノイofficeで勤務をしております神田と申します。\r\n\r\n先日からHanoi勤務をはじめ\r\n物件をできるだけ早く抑えたいと思い\r\n今回御社に連絡を差し上げました。\r\n\r\n下記に物件に求める条件をまとめましたので\r\nお手数ですがご確認の程宜しくお願い致します。\r\n\r\n\r\n＜求める条件＞\r\n・インターネット\r\n・無線Lan（Wi-Fi）\r\n・水道代（可能であれば）\r\n・ランドリー\r\n・ハウスキーピング（可能であれば）\r\n・24時間セキュリティー\r\n・本社からタクシーで15~20分程度の距離\r\n→5th Floor,kinh Do Building,292,Tay Son Str.,Dong Do Dist,Hanoi,Vietnam\r\n\r\nぜひ一度「Hoang Ngoc Phachサービスアパート」\r\n上記の物件に足を運ばせて頂きたいのですが\r\n\r\nいつ頃することが可能でしょうか？\r\n\r\nお手数ですが\r\nご確認の程宜しくお願い致します\r\n\r\n又、現地携帯で\r\n電話・メッセージをすることが可能ですので\r\n\r\n何卒宜しくお願い致します。\r\n\r\n\r\n神田', '2017-02-08 02:17:20', '2017-02-08 02:17:20', NULL, '東京コンサルティンググループ　Hanoi office', 0, 'As soon as possible'),
