(268, '松本　敦至', 'a.matsu0214@gmail.com', '0909242431', 'ご担当者様\r\nこちらのＨＣＭ００００６物件の空き状況をご教示いただけますでしょうか。\r\nまた、1区、3区、Binh Thanh区で2ベッドか広めの1ベッド 900ドル以下の物件のご紹介をお願いできますでしょうか。\r\n4月中に入居希望です。\r\nよろしくお願い致します。\r\n松本', '2017-03-07 07:42:01', '2017-03-07 07:42:01', NULL, '個人', 0, 'Within 1 month'),
(269, '尾関由香里', 'odeki1019@gmail.com', '0969132926', '初めまして、尾関と申します。\r\n現在ロイヤルシティに住んでいますが、来月の26日に更新を迎えます。良いお部屋があれば、ロイヤルシティ内の引っ越しを考えています。予算は1,000〜1,100$です。\r\n出来れば、先に画像で部屋をご紹介して頂きたいと思っております。\r\nよろしくお願いします。', '2017-03-08 04:01:51', '2017-03-08 04:01:51', NULL, '', 1, 'Within 1 month'),
(270, '畑 亜希乃', 'kino_awkohn@yahoo.co.jp', '', '現在空いていますか？ここ以外にも1区3区エリアで下記条件の物件を探していますので、当てはまる物件があればご紹介頂けますでしょうか？\r\n・USD650以下\r\n・二人入居可\r\n・キッチン付き\r\n・洗濯自分で出来る(洗濯機が部屋にあればベスト)\r\n・45平米以上は欲しい(寝室とLDKが分かれている)\r\n・日当たり良好\r\n・二階以上\r\n以上、よろしくお願い致します。', '2017-03-12 05:02:44', '2017-03-12 05:02:44', NULL, '', 1, 'As soon as possible'),
(271, '野田悠将', 'noda@soltecvn.com', '0914856447', 'はじめてご連絡させて頂きます。\r\nソルテックベトナムの野田と申します。\r\n\r\n私の上司（現在ホーチミン担当）が、北部エリアもあわせてカバーすることになり、\r\nハノイ市内（ハイバーチュン、ホアンキエムエリア）で部屋を探しております。\r\n勤務地がHung YenのThang Long2近くになるので、上記エリアで探しております。\r\n\r\nホーチミンにも部屋がある状態なので、予算が限られております。\r\n500ドル前後で探しております。できれば食事等がとれるエリアの近くで探しております。\r\n\r\n本物件以外にもおすすめの物件などありましたらご教示いただけますでしょうか。\r\n3月末より着任予定でおりますので、3月末、4月頭から入居可能な部屋をご紹介いただけましたら幸いです。\r\n\r\nどうぞよろしくお願いいたします。\r\n\r\nソルテックベトナム\r\n野田悠将', '2017-03-14 07:23:27', '2017-03-14 07:23:27', NULL, 'ソルテックベトナム', 0, '29-03-2017'),
(272, '宮川裕', 'hi-miyagawa@tsubame-group.co.jp', '01293171778', 'お世話になっております。\r\n\r\n問い合わせが遅くなり申し訳ございません。\r\n\r\n', '2017-03-15 08:18:27', '2017-03-15 08:18:27', NULL, 'Tsubame E-Time Co., Ltd', 0, 'As soon as possible'),
(273, '宮川裕', 'hi-miyagawa@tsubame-group.co.jp', '01293171778', '\r\n\r\nお世話になっております。\r\nツバメ・イータイムの宮川と申します。\r\n\r\nもうすでにお電話でご連絡をし、物件の紹介を依頼しておりますが、確認のための\r\nメールを送らせていただきます。\r\n女性の担当者様に2度電話をいただきまして、話しましたが、お名前を忘れて\r\nしまいまして申し訳ございません。\r\n\r\n当社では、ただ今レンタルオフィスを探しております。\r\n目的としましては、会社の本社の登記場所の住所変更にともない、現在使っている事務所の貸主から住所変更に\r\n必要な書類（防火認定証明書、建築許可書）が提供されないという問題が発生しました。\r\n\r\n現在のままでは、スムーズに住所変更が行えるかわかりませんので、\r\n一時的にレンタルオフィスで会社の住所登録したいと考えております。\r\n\r\nこの度ご紹介いただけるレンタルオフィスですが、実際にオフィスとしては使いませんので、\r\n住所のみをお借りするというかたちになると思います。\r\nあとその他、必須条件としましては、会社の住所変更に必要な、\r\n防火認定証明書と建築許可書をできるだけはやくいただける物件を希望します。\r\n\r\n現在のところ先ほどお電話で、情報をいただいた御社で経営されているバーチャルオフィスが\r\n当社の希望に合うかなと考えております。\r\n最低契約期間や、防火認定証明と建築許可書がどのくらいでもらえるかも含めまして\r\n教えていただけますと幸甚です。\r\n', '2017-03-15 09:00:59', '2017-03-15 09:00:59', NULL, 'Tsubame E-Time Co., Ltd', 0, 'As soon as possible'),
(274, '吉田', 'tayoshida@honey.ocn.ne.jp', '09065156794', '5/4～三泊にてハノイ、ホーチミンに行く予定がありまして、その際賃貸物件を内覧したいと思っております。百坪程度の超高級物件希望です。場所はハノイ、ホーチミン希望です。候補の物件がございましたら早速資料をご紹介頂けますと幸いです。また、現地でのアテンドは、日本人、または日本語が出来る方を希望。ご返事お待ちしております。どうそ宜しくお願い致します。', '2017-03-19 04:47:25', '2017-03-19 04:47:25', NULL, '', 1, 'Within 2 months'),
(275, 'kawashima yoshihiko', 'devnetyamaguchi@gmail.com', '09085168182', '先ほど電話したカワシマです。\r\n\r\n確認用にフォームでも問い合わせします。\r\n\r\n期間：4/1～4/30\r\n予算：900ドルぐらい\r\n場所：daewoo hotel hanoi 近く\r\n部屋：リビング+ベッドルーム２つ\r\n\r\nよろしくお願いします。', '2017-03-23 02:59:02', '2017-03-23 02:59:02', NULL, '一般財団法人東久邇宮国際文化褒賞記念会', 0, 'As soon as possible'),
(276, '伊藤智明', 'to-itou@mitsui-soko.co.jp', '0838217355', '現在ホーチミンに住んでおり、このたびハイフォンに5月の連休前に異動となりました。\r\n勤務地はディンブー工業地帯で以前　ホテルとして宿泊したサマセットを希望しています。\r\n御社で仲介は可能でしょうか？', '2017-03-24 05:04:51', '2017-03-24 05:04:51', NULL, '三井倉庫', 0, 'Within 1 month'),
(277, '大矢敏美', 'satominmei@gmail.com', '', 'ご担当者様\r\n\r\n大矢敏美（おおやさとみ）と申します。\r\n物件（Thi Sach 1）のコンタクト画面からだとうまく登録ができませんでしたので、問い合わせ画面から失礼します。\r\n3/30にハノイへ渡航し、3/31～4/2の間で内見＆契約を行いたいと思っております。\r\n渡航前にいくつか物件をご紹介いただき、実際に内見して決定したいと思っております。\r\n以下の条件で探しています。\r\n\r\n家賃：400～600USD\r\n間取り：1R、1K、1LDK\r\n場所：ハイバーチュン地区（オフィスが、15th Floor, Prime Center, 53 Quang Trung, Hai Ba Trung District, Hanoi, Vietnam　になります。徒歩圏内もしくはタクシーで5～10分圏内を希望しています。）\r\nその他：新築もしくは築浅でキレイな物件を希望、室内洗濯機ありもしくは自分でも使用可能なところ希望\r\n\r\n現在は日本に住んでおり、初めてのベトナムになります。土地勘がないので、上記の条件に合いそうな物件をご紹介いただけますでしょうか。よろしくお願いいたします。', '2017-03-24 23:54:53', '2017-03-24 23:54:53', NULL, 'JACリクルートメント', 1, '02-04-2017'),
(278, '小島巧', 'kojimavntemp@gmail.com', '01296705311', 'ご担当者様\r\nお世話になります。４年程前にお世話になりました。\r\n現在、サービスアパートの物件を探しています。\r\n条件\r\n１．月額家賃　$2500\r\n２．間取り　2 bed 以上\r\n３．紹介希望物件（優先順）　Lancaster,  Elegant Suite Hoan Kiem,  Somerset Hanoi Tower, Yet Kieu Apartment\r\n会社が Fortuna Hotel 近くなので、キムマ通り方面（Sky City 方面は不可）で優良物件が有ればご紹介頂けませんでしょうか。\r\n４．紹介不要物件　Rose GardenのNgoc Khanh側の部屋, Daeha Apart, Golden West Lake\r\n\r\n１か月後位を目安にしていますが、最長で５月１９日と考えています。\r\n\r\n宜しくお願いします。\r\n\r\n小島\r\n', '2017-03-26 04:56:09', '2017-03-26 04:56:09', NULL, 'Vina-Sanwa Company Liability Limited', 0, 'Within 1 month'),
