(313, '大島', 'amoitalia68@gmail.com', '981437323', 'ご担当者様\r\n\r\n現在単身でハノイのCau Giay地区 Somerset Hoa Binh のすぐそばのアパートに住んでおりますが、\r\n職場（298I Kim Ma)から歩ける距離にあるアパートを探しております。\r\n\r\n家賃400USDくらいまでで、お風呂付きのアパートはございますでしょうか。\r\n洗濯機や掃除機があれば、掃除、洗濯のサービスは不要です。\r\n\r\nまずはメールにてご返信いただければ幸いに存じます。\r\nどうぞよろしくお願い申し上げます。\r\n\r\n大島', '2017-05-23 13:52:05', '2017-05-23 13:52:05', NULL, '', 1, 'Within 1 month'),
(314, '渡邉 大貴', 'w.daiki04@gmail.com', '01658273543', '【物件タイプ】\r\n1ベッドルーム、2ベッドルーム\r\n\r\n【立地】\r\n1区、Binh Tanh区等\r\n→予算的に中心部が困難であればバイクで20分圏内も可能\r\n→ただし、妻がバイクを運転しないので交通の便は一定程度必要\r\n\r\n【予算】\r\n500USD程度\r\n\r\n【居住者】\r\n夫婦2人\r\n\r\n【入居希望日】\r\n2017年9月中旬頃\r\n\r\n【その他】\r\nエアコン付き\r\n部屋に洗濯機があればなおよし\r\nRoom for Rentも検討可能', '2017-05-30 04:44:57', '2017-05-30 04:44:57', NULL, '', 0, 'Within 3 month'),
(315, 'Katya', 'kobzareva@hbmc.vn', '0902892720', 'Good afternoon,\r\n\r\nI am looking for 3BR apartment in Vista or Estella:\r\n- Unfurnished (but with fridge and washing machine)\r\n- Up to $1.500 incl management fees\r\n- Calm (no direct view on highway)\r\n- Available to move in early September\r\n\r\nPlease let me know if you have some options for me.\r\n\r\nBest Regards,\r\nKatya', '2017-06-27 04:38:51', '2017-06-27 04:38:51', NULL, 'HBMC', 1, 'Within 2 months'),
(316, '宮嶋 裕樹 (Miyajima Hiroki)', 'nir.ynwa8@icloud.com', '09017383220', '8月からHung Yenにある会社に勤務予定なのですが、来週に訪越予定があり、7日(金)の午後は時間があるので、本物件含めご紹介頂ければと思います。\r\n宜しくお願いします。\r\n', '2017-06-29 06:03:37', '2017-06-29 06:03:37', NULL, '', 0, '10-08-2017'),
(317, '溝口　英雄', 'mizoguchi@imv.co.jp', '+66-972706595', ' ハノイにて子会社の設立を検討しております。\r\n親会社であるIMV株式会社は振動シュミレーションシステムの製造販売を行っている\r\nメーカーとなりますが、ハノイでの子会社の業態としては、その振動シュミレーションシステムを\r\n使って試験サービスを行う受託試験場を想定しております。\r\nその為、ハノイでの装置の製造は予定しておらず、求められる必要な建屋面積は非常に小さなものになります。\r\nまずは、下記の通り、ざっと希望の内容を書かせて頂きます。\r\n\r\n・建屋床面積は400～600sqm程度を希望。\r\n・敷地内に10台程度の駐車場が確保できる事\r\n・建屋に3m×3m程度の搬入口が確保できる事\r\n・フロアーは１階である事\r\n・電気の供給が安定している事\r\n（当社の試験機は電気にて駆動する装置で、夜中も無人で稼働する事が想定される為、停電はなるべく避けたい）\r\n・場所としてはハノイ市の北エリアを希望します。\r\n（ホアラックハイテクパークが第一希望であり、タンロン１、フーニア、タックタット・フォアックオアイ、）\r\n\r\n上記の様な、ハイテクパークや工業団地で我々が希望する様な、比較的小さなスペースの物件があるのか分かりませんが、\r\nもし、そういった物件を探すのが厳しい様であれば、上記以外の物件などもご紹介頂けますと幸いです。\r\n\r\nよろしくお願い申し上げます。\r\n\r\n以上\r\n', '2017-07-05 04:07:23', '2017-07-05 04:07:23', NULL, 'IMV (THAILAND) CO., LTD', 0, 'Within 6 months'),
(318, '坂田 豊', 'raja.camon@gmail.com', '817044721180', 'Vietnam Housing御中、初めまして、坂田と申します。\r\n私は、約40年間、土木エンジニアとして新日鉄住金や他の会社に勤めておりましたが、6月末に前の会社を退職して、8月から下記会社に現地採用\r\nされることとなりました。\r\n伊藤忠丸紅鉄鋼㈱ ベトナム現地法人会社、Marubeni-Itochu Steel Vietnam Co., Ltd. (2017.8-)\r\n24th Floor, Keangnam Landmark Tower, Pham Hung Street, Me Tri Ward, Nam Tu Liem District, Hanoi City, Vietnam\r\nTel: 84-24-3936-9735, Fax: 84-24-39445-204\r\n\r\nそこで、下記の条件でサービスアパートメントを探しております。\r\n1.入居日：2017年8月早々\r\n2.期間：1年間orそれ以上\r\n3.場所：上記Keangnam Landmarkから車で20分程度以内、Ba Dinh地区またはCau Giay地区\r\n4.部屋の種類：1ベッドルーム(予算が合えば2ベッドルームも可)\r\n5.予算：部屋代、管理費、電気代、水道代等で約1,300USD/月以下。Maxで1,500USD/月　\r\n6.候補：Xuan Hoa Duong Buoi, Hoa Binh Green, Dong Quan, Tran Quy Kien\r\n7.日程　7月末にハノイに行き、当初はホテルに泊まり、候補先を実際に見て決めたいと考えております。\r\n\r\n上記候補先の可否、価格、他候補等につきましてお教えいただきたく、よろしくお願い致します。\r\n\r\n坂田 豊\r\n横浜市港北区小机町2623-4\r\n自宅Tel：81-45-472-8839\r\n携帯Tel：81-70-4472-1180\r\nE-mail：raja.camon@gmail.com\r\n', '2017-07-06 03:53:45', '2017-07-06 03:53:45', NULL, 'Marubeni-Itochu Steel Vietnam Co., Ltd. (2017.8-)', 0, 'Within 1 month'),
