(331, '神田', 'kanda.kei@tokyoconsultinggroup.com', '01644104216', '\r\n\r\n\r\n始めまして。\r\nTokyo consultingの神田と申します。\r\n\r\n※オフィス物件（駐在員事務所用）及び※住居物件の内覧を\r\n8/8（火）～ 8/9（水）の午前中にさせて頂きたくご連絡を差し上げます。\r\n\r\n＜希望オフィス物件（駐在員事務所用）＞\r\n\r\n※オフィス物件の広さは日本人1名と\r\n　ベトナム人1～2名ほどが勤務できる広さでお願い致します。\r\n　従って、レンタルオフィスも拝見させて頂きたく存じます。\r\n\r\n＜希望住居物件（単身者向け用）＞\r\n\r\n※単身赴任を前提に、1LDK～2LDKの広さでお願い致します。\r\n\r\n\r\nオフィス物件（駐在員事務所用）及び\r\n住居物件（単身者向け用）の条件をまとめました。\r\n下記ご確認お願い致します。\r\n\r\n＜希望内容について＞\r\n①～③の【物件】は\r\nオフィス物件（駐在員事務所用）と\r\n住居物件（単身者向け用）の2点を表すものとする。\r\n\r\n①工業業団地に行き来に便利な物件（オフィス/住居）\r\n②住友電装株式会社から少し遠いけれども、価格の安い物件（オフィス/住居）\r\n③住友電装株式会社までの距離が近い物件（オフィス/住居）\r\n\r\n＜備考＞\r\n※オフィス物件及び住居物件は、全て「ハノイ市内」とする。\r\n※オフィス物件及び住居物件は、近くにあることが望ましい。\r\n※住友電装株式会社（ベトナム）住所：\r\nLot XN 03,04,13,14,15,16 Dai An Industrial Zone, Tu Minh Ward,\r\nHai Duong City, Hai Duong Province, Vietnam\r\n\r\n①②③を各2～3件ほど内覧候補物件（オフィス/住居）をご用意して頂きたく存じます。\r\n\r\nつまり、オフィス物件（駐在員事務所用）の内覧候補を合計6～9件\r\n住居物件（単身者向け用）の内覧候補を合計6～9件ほど\r\nご用意して頂きたくことになるかと存じます。\r\n\r\nなお、内覧候補の物件（オフィス/住居）につきましては\r\n場所が確定次第、物件の名前・住所・その他詳細情報に加え\r\n物件の「外観・内覧写真」をメールに添付し、当職に送付して頂ければ幸いです。\r\n\r\n内覧候補の中から\r\n8/8（火）　オフィス物件（駐在員事務所用）,,,3件\r\n8/9（水）　住居物件（単身者向け用）...3件\r\n\r\n合計6件の物件の内覧を\r\n上記日時の午前中にさせて頂きければ幸いです。\r\n\r\n緊急のご連絡となってしまい、大変お手数をお掛け致しますが\r\n内覧候補物件の情報を8月1日若しくは8月2日迄に\r\n当職に送付して頂ければ大変助かります。\r\n\r\n何卒宜しくお願い致します。\r\n\r\n\r\nTokyo consulting\r\n神田\r\n', '2017-07-28 07:00:54', '2017-07-28 07:00:54', NULL, '東京コンサルティンググループ　Hanoi office', 0, 'As soon as possible'),
