(333, 'ヤマリョウ　ミサキ', 'misakist1219@gmail.com', '', '①契約形態（法人or個人）\r\n※法人の場合は御社名もお知らせください。\r\n⇒個人\r\n \r\n②ご入居予定日\r\n⇒8月下旬～9月初旬\r\n \r\n③ご入居者様数\r\n⇒1名様\r\n \r\n④ご希望間取り\r\n⇒1ベッド・スタジオタイプ・１LDK\r\n \r\n⑤ご予算\r\n希望 450USD\r\n \r\n⑥賃料に含まれるサービス(例、家具付き、インターネット(WIFIも)、水道代、掃除、洗濯)\r\n⇒サービスアパート　家具付き*、インターネット(WIFI)、水道代、掃除、シーツ交換\r\n*家具にソファを含む\r\n＊キッチン\r\n \r\n⑦エリア\r\n通勤先の住所や通勤先に車で〇分、徒歩〇分等々の情報でも構いません。\r\n⇒ホーチミン\r\nBao Viet Financial Center Towerまで徒歩10分圏内もしくは、自転車にて10分圏内\r\n \r\n⑧その他ご要望\r\n⇒セキュリティの確認\r\n\r\n以上の内容でお部屋を再度探しております。\r\n\r\n大変お手数ですが、マッチするお部屋をご紹介お願い致します。\r\n\r\n【質問】\r\n労働VISAがおりる前に、契約することは可能でしょうか？\r\nご教示願います。\r\n\r\n', '2017-07-30 06:25:44', '2017-07-30 06:25:44', NULL, '', 1, 'Within 1 month'),
(334, '神田', 'kanda.kei@tokyoconsultinggroup.com', '01644104216', 'ベトナムハウジング\r\n波多野　様\r\n\r\n\r\nいつもお世話になっております。\r\nTokyo consultingの神田と申します。\r\n\r\n※住居物件の内覧の件でご連絡を差し上げます。\r\n下記ご確認お願い致します。\r\n\r\n＜希望住居物件（単身者向け用）＞\r\n\r\n■前提：単身赴任者向け\r\n広さ：1LDK～2LDK程度\r\n立地：内覧予定のオフィス物件の近く\r\n※内覧の手配は、自社で行います。\r\n※候補のオフィスは、DMC(535 Kim Ma), CSC(Icon 4), P office(Indochina),\r\nRegaus(Ly Thai To), HITC(239 Xuan Thuy)を予定しています。\r\n\r\n予算：600USD～1,400USD\r\n※予算については、600USDの水準は、\r\n物件自体少ないと思いますので、これ以上の物件しかなくても\r\n問題ございません。\r\n\r\n＜※希望エリア＞\r\n・Hoan Kiem区(Ha Ba Trung区)\r\n・Ba Dinh区\r\n・Cau Gaiy区\r\n\r\n＜※希望住居物件＞\r\nIndochina Plaza Hanoi、Apartment、241 Xuân Thủy, Dịch Vọng Hậu, Cầu Giấy, Hà Nội\r\nRICHLAND SOUTHERN、Apartment、Ngõ 181 Xuân Thuy, làng Vòng, Dịch Vọng Hậu, Cầu Giấy, Hà Nội\r\nDMC Tower、Apartment、535 Kim Mã, Ngọc Khánh, Ba Đình, Hà Nội\r\n\r\n上記希望住居物件（単身者向け用）3件を含む\r\n内覧候補となる住居物件を合計6～9件ほど\r\nご用意して頂きたく存じます。宜しくお願い致します。\r\n\r\nなお、内覧候補の住居用物件につきましては\r\n場所が確定次第、物件の名前・住所・その他詳細情報に加え\r\n物件の「外観・内覧写真」をメールに添付し、当職に送付して頂ければ幸いです。\r\n※内覧写真は、急ぎのご依頼のため、なくても構いません。\r\n\r\n実際の内覧については、頂いた候補の中から\r\n8/9（水）　住居物件（単身者向け用）...3~4件を予定致します。\r\n\r\n物件の内覧を上記日時の\r\n午前中にさせて頂きければ幸いです。\r\n\r\n緊急のご連絡となってしまい、大変お手数をお掛け致しますが\r\n内覧候補物件の情報を8 月4日迄午前中をめどに\r\n当職に送付して頂ければ大変助かります。\r\n\r\n何卒宜しくお願い致します。\r\n\r\n\r\nTokyo consulting\r\n神田\r\n', '2017-08-03 01:28:08', '2017-08-03 01:28:08', NULL, '東京コンサルティンググループ　Hanoi office', 0, 'As soon as possible'),
(335, '星本賢治', 'k-hoshimoto@hoshimoto.co.jp', '+81-80-61133705', 'お世話になります。株式会社ホシモト 国際部：星本賢治と申します。\r\n弊社では9月よりハノイにて会社設立に向けた申請準備をしており、KimMa、CauGiay地区周辺の賃貸事務所を候補として探しております。\r\n条件は、面積：100㎡前後、$12～18/㎡  DMC TowerやIcon 4 Building または同等のオフィスを想定しています。\r\n8月24日(木)を空けておりますので、この日にいくつかのオフィス物件の内見をしたいと思っております。\r\nそれでは返事をお待ちしております。', '2017-08-08 04:04:08', '2017-08-08 04:04:08', NULL, '株式会社ホシモト', 0, 'Within 3 month'),
(336, '梶　聡(Satoru Kaji)', 's.kaji@nsmv.com.vn', '01648391592', '新たな日本人派遣者用のサービスアパートを探しています。\r\n以下の条件で、候補先とその場所が分かる地図をお送りください。\r\n(1)場所（いずれも赴任者が住んでいる所で、ﾋﾟｯｸｱｯﾌﾟしやすいことが理由)\r\n　1)Fraser(Tây Hồ,）近辺\r\n　2)Sun Red River(Phan Chu Trinh)近辺\r\n　3)Times Cityあるいはその近辺\r\n(2)金額\r\n　Times City～Fraserの近辺\r\n(3)今後のスケジュール\r\n　9月中旬に現地見学\r\n　9月末に入居', '2017-08-15 02:29:59', '2017-08-15 02:29:59', NULL, '日鉄住金建材ベトナム', 0, 'Within 1 month'),
(337, '梶　聡(Satoru Kaji)', 's.kaji@nsmv.com.vn', '01648391592', '新たな日本人派遣者用のサービスアパートを探しています。\r\n以下の条件で、候補先とその場所が分かる地図をお送りください。\r\n(1)場所（いずれも赴任者が住んでいる所で、ﾋﾟｯｸｱｯﾌﾟしやすいことが理由)\r\n　1)Fraser(Tây Hồ,）近辺\r\n　2)Sun Red River(Phan Chu Trinh)近辺\r\n　3)Times Cityあるいはその近辺\r\n(2)金額\r\n　Times City～Fraserの近辺\r\n(3)今後のスケジュール\r\n　9月中旬に現地見学\r\n　9月末に入居', '2017-08-15 02:30:01', '2017-08-15 02:30:01', NULL, '日鉄住金建材ベトナム', 0, 'Within 1 month');
