INSERT INTO `house_translations` (`id`, `house_id`, `name`, `name_crm`, `description`, `summary`, `address`, `seo_url`, `locale`, `keyword`) VALUES
(1, 1, 'Pacific Place（パシフィックプレイス）', '', 'ハノイ中心部の高級コンドミニアム。 敷地内には日系企業も多く入居するオフィス棟があり、レストラン、銀行も併設されています。 屋上にはハノイを一望できるプール、ジムがあり、また有名なBar「Roof Top」があり夜になると紳士、淑女が集まります。', '', '83B Ly Thuong Kiet', '', 'ja', NULL),
(2, 1, '2 Bedroom Apartment For Rent In Pacific Place', '', ' Apartment for rent in Pacific Place, Hoan Kiem, Hanoi. Area of 120sqm, 2 bedrooms, 2 bathrooms, nice living room and kitchen, fully furnished, big balcony with great view. ', '', '83B Ly Thuong Kiet', '', 'en', NULL),
(3, 2, 'Golden Westlake（ゴールデンウェストレイク）', '', 'タイ湖南側にある高級分譲アパート。 比較的賃料が低めなのが魅力で敷地が広く子供が遊べるスペースもあり家族帯同、女性に人気の物件です。 ハノイ中心に位置するので市内に勤務される方にお勧めです。プール、ジム、ヨガスタジオ、ミニマート、レストランあり！', '', '151 Thuy Khue', '', 'ja', NULL),
(4, 2, '02 Bedroom Apartment In Golden Westlake', '', 'West lake view, designed with 02 bedrooms, 01 kitchen, 01 living room, 01 bathrooms and full furniture. Intellectual community area, suitable for foreigners to rent.', '', '151 Thuy Khue', '', 'en', NULL),
(5, 3, 'Golden Westlake（ゴールデンウェストレイク）', '', 'タイ湖南側にある高級分譲アパート。 比較的賃料が低めなのが魅力で敷地が広く子供が遊べるスペースもあり家族帯同、女性に人気の物件です。 ハノイ中心に位置するので市内に勤務される方にお勧めです。プール、ジム、ヨガスタジオ、ミニマート、レストランあり！ 同物件の中でも単身向けの1Bedroomは数も少なく非常に人気です。', '', '151 Thuy Khue', '', 'ja', NULL),
