(7, 4, 'Golden Westlake（ゴールデンウェストレイク）', '', 'タイ湖南側にある高級分譲アパート。 比較的賃料が低めなのが魅力で敷地が広く子供が遊べるスペースもあり家族帯同、女性に人気の物件です。 ハノイ中心に位置するので市内に勤務される方にお勧めです。プール、ジム、ヨガスタジオ、ミニマート、レストランあり！ キッチンと、寝室が広く夫婦のみの方にお勧めです！', '', '151 Thuy Khue', '', 'ja', NULL),
(8, 4, '03 Bedroom Apartment For Rent At Building E, Golden Westlake', '', 'Comfortable apartment for rent. Located in apartment buidling and luxury villas, modern infrastructure with mini golf, garden and playgrounds for children. Free for gym and pool. Intellectual community area, fresh air, clean and beautiful, convenient transportation. Suitable for foreigners and households to rent.', '', '151 Thuy Khue', '', 'en', NULL),
(9, 5, 'Hoa Binh Green（ホアビングリーン）', '', 'シンガポール企業が運営するサービスアパートと個人分譲アパートの併設物件。 建物の高級感、クオリティもよく日系駐在員にも人気の物件です。 建物内にはスーパー、キッズプレイルーム、プール、ジム、ヨガスタジオ、サウナ、屋上にはパター練習場、ゴルフレンジ、BBQスペースもあります。', '', '14 lane 376 Buoi ', '', 'ja', NULL),
