(2351, 1180, 'ZEUS BUILDING\r\nServiced Apartment\r\n', '', '\r\n日本食レストランが多く集まるLinh Lang、Kim Ma通りの近くに\r\n新築のサービスアパートができました。ロッテタワーも徒歩圏内\r\nなのでスーパーマーケット、映画館、カフェ、バー等、生活に\r\n事欠くものが無い大変便利な立地です。\r\n\r\n全室バスタブ付きでかつ、建物一棟で給湯するシステムを採用し\r\n十分な給湯量も確保、家電製品の多くは日本製のものを使用し\r\n皆様に快適な居室空間をお届けいたします。\r\n\r\nまた弊社ベトナムハウジングによる数棟の建物管理、賃貸管理等\r\nの運営実績による、日本人ご入居者様への細部まで行き届いた\r\nサービスを感じていただくとともに、24時間対応の日本語\r\nホットラインは日本人特有の細かいニュアンスまで理解し、\r\n不自由ない対応も可能です。\r\n新築、スポーツジム付き、日本語ホットラインを有するサービス\r\nアパートの中でも低賃料、好立地でご提供できるのは\r\n弊社ベトナムハウジングならではの物件です。\r\n', '', '', '', 'ja', NULL),
(2352, 1181, 'Serviced Apartment in Mai Hac De', 'Serviced Apartment in Mai Hac De', 'New serviced apartment in the central of Hai Ba Trung Dist., with spacious living room, balcony and a private sauna room.\r\nTivi cable, internet, water and electric fees are all included.', 'New serviced apartment in the central of Hai Ba Trung Dist., with spacious living room, balcony and a private sauna room.\r\nTivi cable, internet, water and electric fees are all included.', '27 Mai Hac De', 'temp', 'en', NULL),
(2353, 1181, 'Mai Hac De サービスアパート', 'Mai Hac De サービスアパート', 'Hai Ba Trung区の中心にある新しいサービスアパート。\r\n広いリビングルーム、バルコニー、サウナルームが付いています。\r\n賃料にケーブルテレビ、インターネット、水道代、電気代が含まれます。', 'Hai Ba Trung区の中心にある新しいサービスアパート。\r\n広いリビングルーム、バルコニー、サウナルームが付いています。\r\n賃料にケーブルテレビ、インターネット、水道代、電気代が含まれます。', '27 Mai Hac De', 'temp', 'ja', NULL),
(2354, 1182, 'Hoa Binh Hotel Serviced Apartment', 'Hoa Binh Hotel', 'Newly renovated serviced apartments in Hoa Binh Hotel, located in the very central of Hoan Kiem District.\r\nApartments of 1 bedroom and 2 bedroom types are offered for both daily and monthly rental.\r\nInternet, cable TV and house-keeping services are all included.', 'Newly renovated serviced apartments in Hoa Binh Hotel, located in the very central of Hoan Kiem District.\r\nApartments of 1 bedroom and 2 bedroom types are offered for both daily and monthly rental.\r\nInternet, cable TV and house-keeping services are all included.', '27 Ly Thuong Kiet', 'temp', 'en', NULL),
(2355, 1182, 'Hoa Binh Hotel サービスアパート', 'Hoa Binh Hotel', 'Hoan Kiem区の中心に位置し最近改装されたHoa Binhというサービスアパートです。部屋タイプは1ベッドルームと2ベッドルームの二つのタイプがあります。デイリーでもマンスリーでもご提案できます。家賃にはインターネット、TVケーブル、ハウスキーピングなど含まれています。', 'Hoan Kiem区の中心に位置し最近改装されたHoa Binhというサービスアパートです。部屋タイプは1ベッドルームと2ベッドルームの二つのタイプがあります。デイリーでもマンスリーでもご提案できます。家賃にはインターネット、TVケーブル、ハウスキーピングなど含まれています。', '27 Ly Thuong Kiet', 'temp', 'ja', NULL);
