(25, 28, 'New branch opened in HaiPhong City', 'First branch of Vietnamhousing in HaiPhong was opened on August 2012.<br />\r\nThe new branch located at the following address:<br />\r\n <br />\r\nAdd: No. 101, Lot 22, Le Hong Phong Street,<br />\r\nNgo Quyen District, HaiPhong City, Vietnam<br />\r\n <br />\r\nTel: 0313-761-639<br />\r\nFax: 0313-761-638', 'First branch of Vietnamhousing in HaiPhong was opened on August 2012.<br />\nThe new branch located at the following address:<br />\n <br />\nAdd: No. 101, Lot 22, Le Hong Phong Street,<br />\nNgo Quyen District, HaiPhong City, Vietnam<br />\n <br />\nTel: 0313-761-639<br />\nFax: (84-4) 3944 9489', '', 'en', NULL),
(26, 28, 'ハイフォン(HaiPhong)支店を開店いたしました', 'ハイフォン(HaiPhong)支店を開店いたしました<br />\r\n住所、連絡先は下記となります。<br />\r\nNo. 101, Lot 22, Le Hong Phong Street<br />\r\nNgo Quyen District, HaiPhong City, Vietnam<br />\r\nTel: 0313-761-639　Fax: 0313-761-638', 'ハイフォン(HaiPhong)支店を開店いたしました<br />\n住所、連絡先は下記となります。<br />\nNo. 101, Lot 22, Le Hong Phong Street<br />\nNgo Quyen District, HaiPhong City, Vietnam<br />\nTel: 0313-761-639　Fax: (84-4) 3944 9489', '', 'ja', NULL),
(27, 29, 'ISN Corporation – Vietnamhousing managed Dolphin Plaza Serviced Apartments', 'From December 2012, Vietnamhousing started managing Serviced Apartments of Dolphin Residence Project at No. 28, Tran Binh Street, My Dinh, TuLiem, Hanoi.<br />\r\nDolphin Plaza’s contacts:<br />\r\nTel: 04-6-686-1408<br />\r\nFax: 04-3-795-9946', 'From December 2012, Vietnamhousing started managing Serviced Apartments of Dolphin Residence Project at No. 28, Tran Binh Street, My Dinh, TuLiem, Hanoi.<br />\nDolphin Plaza’s contacts:<br />\nTel: 04-6-686-1408<br />\nFax: 04-3-795-9946', '', 'en', NULL),
