(29, 31, '', 'キャンドル(CANDLE)ホテル はハノイの中心に位置(DOI CAN通り）し、ホテル72室、サービスアパート69室を有するハノイで初めての日本人向け4スターホテルです。ロケーションはタイ湖の南側、ハノイを環状する幹線道路の中心に位置しハノイの東西の中心ともいえる位置です。\r\n<br>\r\n住所、連絡先は下記となります。\r\n<br>\r\nNo. 287 Doi Can Street, Ba Dinh, Hanoi.\r\n<br>\r\nお問い合わせ専門窓口：ベトナムハウジング村尾\r\n<br>\r\nTel: 091965 9809  Email: murao@vietnamhousing.vn', '', '', 'en', NULL),
(30, 31, 'キャンドル(CANDLE)ホテル の運営を開始いたしました', 'キャンドル(CANDLE)ホテル はハノイの中心に位置(DOI CAN通り）し、ホテル72室、サービスアパート69室を有するハノイで初めての日本人向け4スターホテルです。ロケーションはタイ湖の南側、ハノイを環状する幹線道路の中心に位置しハノイの東西の中心ともいえる位置です。\r\n<br>\r\n住所、連絡先は下記となります。\r\n<br>\r\nNo. 287 Doi Can Street, Ba Dinh, Hanoi.\r\n<br>\r\nお問い合わせ専門窓口：ベトナムハウジング村尾\r\n<br>\r\nTel: 091965 9809  Email: murao@vietnamhousing.vn', '', '', 'ja', NULL),
(35, 35, '', '各位<br />\r\n&nbsp;<br />\r\n拝啓<br />\r\n新春の候、時下ますますご清祥の段、お慶び申し上げます。平素は格別のご高配を賜り、厚く御礼申し上げます。<br />\r\nさて、ベトナム旧正月（テト）により下記期間中は弊社休業日となります。<br />\r\n&nbsp;<br />\r\n2015年2月15日（日）　～　2015年2月23日（月）<br />\r\n緊急連絡先（日本人直通）：091-965-9809<br />\r\n&nbsp;<br />\r\n皆様には大変ご不便をおかけいたしますが、何卒ご理解の程よろしくお願い申し上げます。<br />\r\nまた良い年を迎えられるよう弊社一同、心よりお祈り申し上げます。<br />\r\n&nbsp;<br />\r\n敬具', '', '', 'en', NULL),
