INSERT INTO `office_translations` (`id`, `office_id`, `name`, `name_crm`, `description`, `address`, `seo_url`, `locale`, `keyword`) VALUES
(1, 1, 'Charmvit Tower', '', 'Class A office located near Vietnam National Convention Center. With the total investment of 120 million US Dollars, Charmvit VIT Grand Plaza Hanoi is designed and built', 'Tran Duy Hung', '', 'ja', NULL),
(2, 1, 'Charmvit Tower', '', 'Class A office located near Vietnam National Convention Center. With the total investment of 120 million US Dollars, Charmvit VIT Grand Plaza Hanoi is designed and built', 'Tran Duy Hung', '', 'en', NULL),
(3, 2, 'CMC Tower', '', 'CMC Tower is class B office near Keangnam Landmark, in Duy Tan Street, Cau Giay where many other office buildings are located like FPT, Tien Phong, 3A Building, etc and near banks, supermarkets, bus station.', 'Duy Tan', '', 'ja', NULL),
(4, 2, 'CMC Tower', '', 'CMC Tower is class B office near Keangnam Landmark, in Duy Tan Street, Cau Giay where many other office buildings are located like FPT, Tien Phong, 3A Building, etc and near banks, supermarkets, bus station.', 'Duy Tan', '', 'en', NULL),
(5, 3, 'Keangnam Hanoi Landmark Tower', '', 'Class A office in Keangnam Landmark Tower. The Tower includes 70 stories above ground and 02 underground stories, built on an area of 46,000sqm, convenient place where many central agencies, administrative bodies, The National Conference Center,etc are located. It\'s total area is 579.000sqm.', 'Pham Hung', '', 'ja', NULL),
(6, 3, 'Keangnam Hanoi Landmark Tower', '', 'Class A office in Keangnam Landmark Tower. The Tower includes 70 stories above ground and 02 underground stories, built on an area of 46,000sqm, convenient place where many central agencies, administrative bodies, The National Conference Center,etc are located. It\'s total area is 579.000sqm.', 'Pham Hung', '', 'en', NULL),
(7, 4, 'CDC Tower', '', 'Hai Ba TrungにあるBクラスオフィスビル', 'Le Dai Hanh', '', 'ja', NULL),
(8, 4, 'CDC Tower', '', 'The office building  is built and designed following high quality office standard; the building consists of 16 stories with 02 basement stories. CDC Building is the perfect combination of classic French architecture which provides efficient and dynamic working environment.', 'Le Dai Hanh', '', 'en', NULL),
(9, 5, 'Vinafor Building', '', 'Hai Ba TrungにあるBクラスオフィスビル', 'Lo Duc', '', 'ja', NULL),
(10, 5, 'Vinafor Building', '', 'Beginning in use from July 2012, Vinafor is one of the brightest class B offices in the center of Hanoi. Located in Lo Duc street which is in easy connection with other districts through the main roads like Tran Khat Chan, Tran Nhan Tong, Tran Hung Dao streets. The building is comprised of 14 stories and built on 2.000m2 with total floor plan of 19.195,9m2 (excluding basement).', 'Lo Duc', '', 'en', NULL),
(11, 6, 'ACB Office Building', '', 'ACB office building consists of 11 stories above ground and 02 basement stories, with total area of 6764sqm. The building provides open and modern office space among vibrant financial and economic CBD.\r\nSituated on Phan Chu Trinh and Pham Su Manh street, it takes only few minutes walk from ACB to access to important locations of the city like Finance Ministry Headquarters, The State Bank of Vietnam, Hanoi Opera House, Hoan Kiem Lake, City Central Post Office and major commercial centers...', 'Phan Chu Trinh', '', 'ja', NULL),
(12, 6, 'ACB Office Building', '', 'ACB office building consists of 11 stories above ground and 02 basement stories, with total area of 6764sqm. The building provides open and modern office space among vibrant financial and economic CBD.\r\nSituated on Phan Chu Trinh and Pham Su Manh street, it takes only few minutes walk from ACB to access to important locations of the city like Finance Ministry Headquarters, The State Bank of Vietnam, Hanoi Opera House, Hoan Kiem Lake, City Central Post Office and major commercial centers...', 'Phan Chu Trinh', '', 'en', NULL),
(13, 7, 'VIT Building', '', 'IPH provides a working environment with superior quality standard with class A office in Hanoi, 11 stories are located above the vibrant commercial center. Creative design of the building provides about 14,000 sqm (land use) which makes the office space is utilized efficiently.', 'Kim Ma', '', 'ja', NULL),
(14, 7, 'VIT Building', '', 'IPH provides a working environment with superior quality standard with class A office in Hanoi, 11 stories are located above the vibrant commercial center. Creative design of the building provides about 14,000 sqm (land use) which makes the office space is utilized efficiently.', 'Kim Ma', '', 'en', NULL),
