INSERT INTO `recruitment_informations` (`id`, `position`, `content`, `public_date`, `expiration_date`, `created_at`, `updated_at`, `deleted_at`, `recruitment_area`) VALUES
(2, 'ISN tuyển dụng nhân viên IT', 'Nơi làm việc: Hà Nội/Hải Phòng<br>\r\nMô tả công việc:<br>\r\n-	Cung cấp dịch vụ tư vấn bất động sản cho cộng đồng người Nhật tại Hà Nội/Hải Phòng: Dẫn khách xem nhà, đàm phán ký kết hợp đồng, chăm sóc khách hàng sau khi giới thiệu.<br>\r\n-	Phát triển, mở rộng mạng lưới khách hàng Nhật.<br>\r\n-	Quản lý tòa nhà, căn hộ cho khách hàng Nhật.<br>\r\n-	 Chi tiết công việc sẽ trao đổi khi phỏng vấn<br>\r\n\r\nYêu cầu:<br>\r\n-	Nam/ nữ, tuổi từ 22 ~30<br>\r\n-	Tốt nghiệp khoa Tiếng Nhật các trường Đại học trên toàn quốc hoặc du học sinh. Sinh viên mới ra trường sẽ được đào tạo.<br>\r\n-	Tiếng Nhật tương đương 2 kyu trở lên<br>\r\n-	 Có nguyện vọng gắn bó lâu dài với công ty<br>\r\nQuyền lợi:<br>\r\n-	Mức lương: từ 10 ~ 12 triệu/tháng + phụ cấp xăng xe, điện thoại.<br>\r\n-	Được hưởng đầy đủ chế độ đãi ngộ theo luật định (HĐ lao động, Lương tháng 13, Thưởng ngày lễ, BHXH, BHYT, BHTN, khám sức khỏe định kỳ; du lịch hàng năm).<br>\r\n-	Làm việc trong môi trường trẻ, năng động.<br>\r\n\r\nThông tin liên hệ:<br>\r\nMs. Thảo – Phòng Nhân sự\r\nISN Corporation<br>\r\nP602, 11 Trần Hưng Đạo, Q. Hoàn Kiếm, Hà Nội<br>\r\nĐT: 04.3944 9488<br>\r\nEmail: thaont@vietnamhousing.vn', '2016-02-11 00:00:00', NULL, '2017-07-17 12:19:26', '2017-07-17 04:19:26', '2017-07-17 04:19:26', 'Hà Nội, Hải Phòng'),
(3, 'ISN tuyển dụng NV Phát Triển Thị Trường Bất Động Sản', '<p><strong>M&Ocirc; TẢ: </strong></p>\r\n\r\n<p>- T&igrave;m kiếm v&agrave; quản l&yacute;&nbsp;cơ sở dữ liệu BĐS&nbsp;(bao gồm th&ocirc;ng tin&nbsp;nh&agrave;, căn hộ, văn ph&ograve;ng, cửa h&agrave;ng cho thu&ecirc;)</p>\r\n\r\n<p>- Tư vấn, hỗ trợ, chăm s&oacute;c kh&aacute;ch h&agrave;ng của C&ocirc;ng ty.</p>\r\n\r\n<p>- Chịu tr&aacute;ch nhiệm về doanh số&nbsp;th&aacute;ng/qu&yacute;/năm.</p>\r\n\r\n<p><strong>Y&Ecirc;U CẦU: </strong></p>\r\n\r\n<p>- Nam, tốt nghiệp Đại học</p>\r\n\r\n<p>- Kỹ năng đ&agrave;m ph&aacute;n, giao tiếp tốt,&nbsp;Tiếng Anh cơ bản.</p>\r\n\r\n<p><strong>QUYỀN LỢI: </strong></p>\r\n\r\n<p>- Mức lương: từ 10 ~ 12 triệu/th&aacute;ng + phụ cấp xăng xe, điện thoại.</p>\r\n\r\n<p>- Được hưởng đầy đủ chế độ đ&atilde;i ngộ theo luật định</p>\r\n\r\n<p><strong>LI&Ecirc;N HỆ: </strong></p>\r\n\r\n<p>Ms. Hương&nbsp;&ndash; P602, 11 Trần Hưng Đạo, Q. Ho&agrave;n Kiếm, H&agrave; Nội</p>\r\n\r\n<p>ĐT: 04.3944 9488</p>\r\n\r\n<p>Email: huonglq@vietnamhousing.vn</p>\r\n', '2017-07-01 00:00:00', '2017-07-31 00:00:00', '2017-07-28 14:40:35', '2017-07-28 06:40:35', NULL, 'Hà Nội'),
(4, 'ISN tuyển dụng Nhân Viên Chăm Sóc Khách Hàng Nhật', '<p><strong>NƠI L&Agrave;M VIỆC:</strong> H&agrave; Nội</p>\r\n\r\n<p><strong>M&Ocirc; TẢ C&Ocirc;NG VIỆC: </strong></p>\r\n\r\n<p>- Quản l&yacute; dữ liệu kh&aacute;ch h&agrave;ng</p>\r\n\r\n<p>- Tiếp nhận v&agrave; giải đ&aacute;p thắc mắc của kh&aacute;ch h&agrave;ng</p>\r\n\r\n<p>- Thăm hỏi kh&aacute;ch h&agrave;ng theo định kỳ qua điện thoại, email, gặp gỡ trực tiếp&hellip;</p>\r\n\r\n<p>- Đ&aacute;nh gi&aacute; mức độ h&agrave;i l&ograve;ng của kh&aacute;ch h&agrave;ng đối với dịch vụ của C&ocirc;ng ty.</p>\r\n\r\n<p>- Thực hiện c&aacute;c nhiệm vụ kh&aacute;c theo y&ecirc;u cầu c&ocirc;ng việc v&agrave; sự ph&acirc;n c&ocirc;ng của cấp tr&ecirc;n.</p>\r\n\r\n<p>- C&ocirc;ng việc cụ thể sẽ trao đổi trực tiếp khi phỏng vấn.</p>\r\n\r\n<p><strong>Y&Ecirc;U CẦU: </strong></p>\r\n\r\n<p>- Nam/ nữ, tuổi từ 22 ~35</p>\r\n\r\n<p>- Tốt nghiệp Đại học - Tiếng Nhật (Bắt buộc), biết&nbsp;Tiếng Anh l&agrave; lợi thế</p>\r\n\r\n<p>- Ưu ti&ecirc;n c&oacute; kinh nghiệm</p>\r\n\r\n<p>- C&oacute; nguyện vọng gắn b&oacute; l&acirc;u d&agrave;i với c&ocirc;ng ty</p>\r\n\r\n<p><strong>QUYỀN LỢI: </strong></p>\r\n\r\n<p>- Mức lương: từ 500 ~ 700 $/th&aacute;ng + phụ cấp xăng xe, điện thoại.</p>\r\n\r\n<p>- Được hưởng đầy đủ chế độ đ&atilde;i ngộ theo luật định (HĐ lao động, Lương th&aacute;ng 13, Thưởng ng&agrave;y lễ, BHXH, BHYT, BHTN, kh&aacute;m sức khỏe định kỳ; du lịch h&agrave;ng năm).</p>\r\n\r\n<p>- L&agrave;m việc trong m&ocirc;i trường trẻ, năng động.</p>\r\n\r\n<p><strong>TH&Ocirc;NG TIN LI&Ecirc;N HỆ: </strong></p>\r\n\r\n<p>Ms. Hương&nbsp;&ndash; Ph&ograve;ng Nh&acirc;n sự ISN Corporation</p>\r\n\r\n<p>P602, 11 Trần Hưng Đạo, Q. Ho&agrave;n Kiếm, H&agrave; Nội</p>\r\n\r\n<p>ĐT: 04.3944 9488</p>\r\n\r\n<p>Email: huonglq@vietnamhousing.vn</p>\r\n', '2017-07-01 00:00:00', '2017-07-17 00:00:00', '2017-07-24 10:29:22', '2017-07-24 02:29:22', NULL, 'Hà Nội'),
(5, 'ISN tuyển dụng Nhân Viên Kinh Doanh Bất Động Sản', '<p><strong>NƠI L&Agrave;M VIỆC:</strong> H&agrave; Nội</p>\r\n\r\n<p><strong>M&Ocirc; TẢ C&Ocirc;NG VIỆC: </strong></p>\r\n\r\n<p>- Cung cấp dịch vụ tư vấn mua b&aacute;n c&aacute;c dự &aacute;n BĐS&nbsp;tại H&agrave; Nội:</p>\r\n\r\n<p>- T&igrave;m kiếm kh&aacute;ch h&agrave;ng, tư vấn v&agrave; giới thiệu c&aacute;c sản phẩm BĐS&nbsp;của C&ocirc;ng ty.&nbsp;</p>\r\n\r\n<p>- Tư vấn c&aacute;c th&ocirc;ng tin về gi&aacute; cả, chế độ ưu đ&atilde;i,&nbsp;chương tr&igrave;nh vay vốn v&agrave; lựa chọn c&aacute;c căn hộ ph&ugrave; hợp với nhu cầu của kh&aacute;ch h&agrave;ng</p>\r\n\r\n<p>- Tư vấn v&agrave; hỗ trợ về c&aacute;c thủ tục mua b&aacute;n v&agrave; c&aacute;c thủ tục ph&aacute;p l&yacute; cho kh&aacute;ch h&agrave;ng</p>\r\n\r\n<p><strong>Y&Ecirc;U CẦU</strong>:</p>\r\n\r\n<p>- Nam/ Nữ, tuổi từ 22 trở l&ecirc;n, ngoại h&igrave;nh ưa nh&igrave;n</p>\r\n\r\n<p>- C&oacute; kinh nghiệm kinh doanh, đặc biệt ưu ti&ecirc;n c&oacute; kinh nghiệm về BĐS</p>\r\n\r\n<p>- Tốt nghiệp Cao đẳng trở l&ecirc;n chuy&ecirc;n ng&agrave;nh QTKD, BĐS, kinh tế, marketing&hellip;</p>\r\n\r\n<p>- C&oacute; nguyện vọng gắn b&oacute; l&acirc;u d&agrave;i</p>\r\n\r\n<p><strong>QUYỀN LỢI: </strong></p>\r\n\r\n<p>- Thu nhập hấp dẫn: Lương cơ bản cao + Thưởng hoa hồng</p>\r\n\r\n<p>- Được hưởng đầy đủ chế độ đ&atilde;i ngộ theo luật định (HĐ lao động, Lương th&aacute;ng 13, Thưởng ng&agrave;y lễ, BHXH, BHYT, BHTN, kh&aacute;m sức khỏe,&nbsp;du lịch h&agrave;ng năm).</p>\r\n\r\n<p>- L&agrave;m việc trong m&ocirc;i trường năng động</p>\r\n\r\n<p><strong>LI&Ecirc;N HỆ: </strong></p>\r\n\r\n<p>Ms. Hương&nbsp;&ndash; Ph&ograve;ng Nh&acirc;n sự ISN Corporation</p>\r\n\r\n<p>P602, 11 Trần Hưng Đạo, Q. Ho&agrave;n Kiếm, H&agrave; Nội</p>\r\n\r\n<p>ĐT: 04.3944 9488</p>\r\n\r\n<p>Email: huonglq@vietnamhousing.vn</p>\r\n', '2017-07-01 00:00:00', '2017-07-31 00:00:00', '2017-07-24 10:23:20', '2017-07-24 02:23:20', NULL, 'Hà Nội'),
(6, 'ISN tuyển dụng NV lễ tân hành chính biết tiếng Nhật', '<p><strong>NƠI L&Agrave;M VIỆC:</strong>&nbsp;H&agrave; Nội</p>\r\n\r\n<p><strong>M&Ocirc; TẢ C&Ocirc;NG VIỆC:</strong></p>\r\n\r\n<p>- Tiếp nhận v&agrave; giải đ&aacute;p thắc mắc của kh&aacute;ch h&agrave;ng</p>\r\n\r\n<p>- Thăm hỏi kh&aacute;ch h&agrave;ng theo định kỳ qua điện thoại, email, gặp gỡ trực tiếp&hellip;</p>\r\n\r\n<p>- Đ&aacute;nh gi&aacute; mức độ h&agrave;i l&ograve;ng của kh&aacute;ch h&agrave;ng đối với dịch vụ của C&ocirc;ng ty.</p>\r\n\r\n<p>- Thực hiện c&aacute;c nhiệm vụ kh&aacute;c theo y&ecirc;u cầu c&ocirc;ng việc v&agrave; sự ph&acirc;n c&ocirc;ng của cấp tr&ecirc;n.</p>\r\n\r\n<p><strong>Y&Ecirc;U CẦU: </strong></p>\r\n\r\n<p>- Nam/ nữ, tuổi từ 22 ~30</p>\r\n\r\n<p>- Tốt nghiệp Đại học</p>\r\n\r\n<p>- Tiếng Nhật (bắt buộc) tr&igrave;nh độ N2, biết tiếng Anh l&agrave; lợi thế</p>\r\n\r\n<p>- C&oacute; nguyện vọng gắn b&oacute; l&acirc;u d&agrave;i với c&ocirc;ng ty</p>\r\n\r\n<p><strong>QUYỀN LỢI: </strong></p>\r\n\r\n<p>- Mức lương: từ 400 ~ 600 $/th&aacute;ng + phụ cấp xăng xe, điện thoại.</p>\r\n\r\n<p>- Được hưởng đầy đủ chế độ đ&atilde;i ngộ theo luật định (HĐ lao động, Lương th&aacute;ng 13, Thưởng ng&agrave;y lễ, BHXH, BHYT, BHTN, kh&aacute;m sức khỏe định kỳ; du lịch h&agrave;ng năm).</p>\r\n\r\n<p>- L&agrave;m việc trong m&ocirc;i trường trẻ, năng động.</p>\r\n\r\n<p><strong>LI&Ecirc;N HỆ: </strong></p>\r\n\r\n<p>Ms. Hương&nbsp;&ndash; Ph&ograve;ng Nh&acirc;n sự ISN Corporation</p>\r\n\r\n<p>P602, 11 Trần Hưng Đạo, Q. Ho&agrave;n Kiếm, H&agrave; Nội</p>\r\n\r\n<p>ĐT: 04.3944 9488</p>\r\n\r\n<p>Email: huonglq@vietnamhousing.vn</p>\r\n', '2017-07-01 00:00:00', '2017-07-31 00:00:00', '2017-07-24 10:26:11', '2017-07-24 02:26:11', NULL, 'Hà Nội');
