(9, 'Phạm Hải Linh', '0912225868 /0904070187', 'phamhailinh1982@gmail.com', '33/8 ngõ 379 Đội Cấn', 'Cho thuê căn hộ tầng 23 chung cư Hòa Bình Green city ngõ 376 Đường Bưởi quận Ba Đình - Hà Nội, ban công view Hồ Tây, 2 phòng ngủ, diện tích 70m2, nội thất đầy đủ vào ở được luôn. Tòa nhà có đầy đủ các tiện ích, siêu thị, phòng tập gym, bể bơi, sân tập golf. Giá thuê 1000 usd/tháng. ', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-04-01 10:52:32', '2016-04-01 10:52:32', NULL),
(10, 'Nguyễn Thị Kim Thanh', '0983471663', 'annie.vu89@gmail.com', 'Van Cao, Ba Dinh, Ha Noi', 'A brand new serviced apartment building near Lotte Center and Japan Embassy. Fully furnished. Suitable for singles and couples.', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-04-12 15:25:55', '2016-04-12 15:25:55', NULL),
(11, 'Đức', '0913210077', 'hohoangdiep@yahoo.com', '172 Ngọc Khánh, Ba Đình, Hà Nội', 'Cho thuê căn hộ tại tòa nhà Artex building - 172 Ngọc Khánh, Hà Nội. DT 154m2, 3 phòng ngủ, 2 WC, căn góc, 3 mặt thoáng, ban công ĐN, có TV LED 55\", tủ lạnh side-by-side, lò nướng, bếp từ, hút mùi, máy giặt nước nóng, điều hòa inverter ... Căn hộ hoàn thiện sang trọng với toàn bộ thiết bị bếp, hệ thống đèn và trang trí được nhập khẩu từ Đức. Sofa nhập khẩu Đức. Phong cách châu Âu hiện đại. Giá 1.000$/1 tháng. Chính chủ: A Đức 0913210077 (có thể gọi thường hoặc Viber) hoặc bà Huệ 01216082264.\r\n', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-04-26 11:37:26', '2016-04-26 11:37:26', NULL),
(12, 'Võ Thị Thu Hoài', '093 251 2938', 'hoaivo.dqmedia@gmail.com', 'Hung Vuong 1 Apartment - District 7', 'Cho thuê căn hộ, nội thất cao cấp, thiết kế mở, thoáng mát tầng áp mái, có gác lửng, có sân thượng (chung), toàn bộ thiết bị vật dụng cao cấp mới trang bị.\r\nSàn gỗ, 2 máy lạnh Electrolux, bếp điện từ Fagor, Lò nướng Electrolux, Microwave Teka, Smart tivi 55\" màn hình cong, tủ lạnh Toshiba inverter, máy giặt Electrolux, phòng tắm có xông hơi,....\r\nGiá thuê: 550 USD/ tháng \r\n\r\n\r\nApartment for rent, furnished, open design, airy loft, with mezzanine, terrace (shared), all equipment, new luxury items fitted,\r\nParquet, 2 freezers Electrolux, Fagor cookers, ovens Electrolux, Microwave Teka, Smart TV 55 \"screen curve, Toshiba inverter refrigerator, washing machine Electrolux, with a steam bath ....', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-04-29 11:29:17', '2016-04-29 11:29:17', NULL),
(13, 'Nguyen Quynh Trang', '0913042849', 'trangaki@gmail.com', 'Hanoi', 'Tôi có 01 căn hộ rộng 111m2 tại tòa nhà Starcity - 81 Lê Văn Lương. Căn hộ 3 phòng ngủ, 2 phòng vệ sinh, phòng đọc sách và bếp. Nội thất cao cấp, trang bị đầy đủ, có nhu cầu cho khách thuê lâu dài. Nếu có khách xin vui lòng liên hệ với tôi qua số điện thoại đăng ký, Xin cảm ơn', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-05-09 11:01:14', '2016-05-09 11:01:14', NULL),
(14, 'nguyen quynh trang', '+84913042849', 'trangaki@gmail.com', 'Hanoi', 'Tôi có căn hộ rộng 111m2, nằm trên tòa nhà Starcity số 81 Lê Văn Lương, Hà Nội, Căn hộ được trang bị nội thất hiện đại, đầy đủ đồ đạc. 3 phòng ngủ, 2 phòng vệ sinh, 1 phòng khách, 1 bếp và 1 phòng đọc sách. Internet cáp quang và TV truyền hình cáp. có nhu cầu cho thuê lâu dài. Xin liên hệ với tôi theo số điện thoại: 0913.042.849. Xin cảm ơn !', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-05-10 12:30:37', '2016-05-10 12:30:37', NULL),
(15, 'Linh', '0912225868 /0904070187', 'phamhailinh1982@gmail.com', 'Hà Nội', 'Cho thuê căn hộ tầng 23 chung cư Hòa Bình Green city ngõ 376 Đường Bưởi, diện tích 70m2, đã sửa làm lại mới nội thất trong căn hộ.', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-05-19 17:17:29', '2016-05-19 17:17:29', NULL),
(16, 'Tran Thi Thuy Hang', '0902193928', 'tranthuyhang@hotmail.com', 'Ngõ 71 Linh Lang', 'Nhà riêng, 6 tầng, có 5 phòng khép kín, được trang bị đầy đủ đồ dùng, thiết bị sinh hoạt, cần cho thuê, ưu tiên khách Nhật Bản. Diện tích mỗi phòng khoảng 35m2, view đẹp, cửa nhìn ra công viên cây xanh, thoáng mát, an ninh tốt. ', 3, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-07-05 16:55:36', '2016-07-05 16:55:36', NULL),
(17, 'Phạm Tiến Huy', '0989996646', 'phamtienhuy1975@gmail.com', 'Hải An, TP Hải Phòng', 'Cần cho người nước ngoài (Châu Âu hoặc Nhật bản) thuê nguyên 01 nhà biệt thự 04 tầng gồm 06 phòng ngủ, 06 wc, bếp, phòng khách, tầng hầm. Toàn bộ thiết bị vệ sinh nhập khẩu từ hãng toto Nhật bản, nội thất, sàn nhà ốp gỗ óc chó. Gara có thể để được 04 xe ô tô. bảo vệ 24/24. Có vườn tùng, cỏ nhật, hồ cá. rất phù hợp với hộ gia đình hoặc 5-6 người độc thân. Cho thuê thời gian tối thiểu 1 năm ', 3, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-07-20 09:02:29', '2016-07-20 09:02:29', NULL),
(18, 'Dinh Tien Ngu', '0903286217', 'ngudinhtien@gmail.com', 'N12A12A Vinhomes 54 Nguyen Chi Thanh, Dong Da district, Hanoi', ' Vinhomes Nguyen Chi Thanh, Ba Dinh district, modern, luxury, centrally located and brand new apartment for rent\r\nBrand new apartment, total area 86 m2 including living room, 2 bedrooms, 2 bathrooms, separate kitchen, modernly equipped with luxury decoration. \r\nThe apartment locates in modern Vinhomes Tower and offers all kinds of amenities such as shopping mall, supermarket, Vinschool, cinema, restaurants, gymnasium, swimming pool, parking, security 24/7 and others. No service charge for the first 10 years. \r\nVinhomes tower locates on Nguyen Chi Thanh street, easy for transport, near Daewoo hotel, Lotte Center, Japanese, Australian, Korean embassies. \r\nMonthly rent is 1300 USD. \r\n', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-07-20 20:38:36', '2016-07-20 20:38:36', NULL),
(19, 'Ms Hoa', '0933668300', 'minori.jv@gmail.com', '5B ngo 551 Kim Ma, Ba Dinh, Hanoi', 'Toà nhà căn hộ dịch vụ, 100% dành cho khách Nhật. \r\nVị trí thuận tiện, căn hộ rộng và sáng tự nhiên \r\nQuản lý tiếng Nhật ', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-08-27 18:32:31', '2016-08-27 18:32:31', NULL),
(20, 'Nguyen Quynh Trang', '0913042849', 'trangaki@gmail.com', 'Hanoi', 'Cho thuê nhà chính chủ\r\nCăn hộ chung cư cao cấp khu vực Lê Văn Lương, Hà Nội. Nhà bao gồm 3 phòng ngủ, 1 phòng khách, 1 bếp, 1 phòng đọc sách và 2 phòng vệ sinh. Tất cả các phòng đều được trạng bị đồ đạc cao cấp, tiện nghi. Phù hợp cho hộ gia đình hoặc người nước ngoài thuê để ở. Nhà chính chủ, khách thuê có thể dọn đến ở từ 1/11/2016\r\n', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-10-03 16:10:00', '2016-10-03 16:10:00', NULL),
(21, 'Thuận', '0904881652/0989713343', 'thuan.nguyenvan1808@gmail.com', '12B01 T18 Times city - 458 minh Khai ', 'Gửi Vietnamhousing\r\n\r\nTôi có căn hộ 12B01-tòa T18 times city đang cần cho thuê.\r\nCăn hộ 3 ngủ, tầng 12B view quảng trường rất đẹp.\r\nCăn hộ có thể cho thuê đủ đồ hoặc không đồ, thêm đồ theo yêu cầu của khách hàng.\r\n\r\n\r\nLiên lạc:\r\nThuận:0904.881.652(Japanese OK)\r\nNgọc:0989.713.343(English OK)\r\n\r\nRegards,\r\n\r\nThuận', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-10-10 09:59:26', '2016-10-10 09:59:26', NULL),
(22, 'Thuận', '0904881652/0989713343', 'thuan.nguyenvan1808@gmail.com', '12B01 T18 Times city - 458 minh Khai ', 'Gửi Vietnamhousing\r\n\r\nTôi có căn hộ 12B01-tòa T18 times city đang cần cho thuê.\r\nCăn hộ 3 ngủ, tầng 12B view quảng trường rất đẹp.\r\nCăn hộ có thể cho thuê đủ đồ hoặc không đồ, thêm đồ theo yêu cầu của khách hàng.\r\n\r\n\r\nLiên lạc:\r\nThuận:0904.881.652(Japanese OK)\r\nNgọc:0989.713.343(English OK)\r\n\r\nRegards,\r\n\r\nThuận', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, 'Các vấn đề khác', '2016-10-10 09:59:48', '2016-10-10 09:59:48', NULL),
(23, 'Phạm Khánh', '0915446622', 'khanhpv2407@gmail.com', 'Ha Noi', 'Dear,\r\nMình bên sàn bất động sản ACG, muốn kết hợp với bên mình để cho thuê căn hộ tại các dự án cao cấp tại HN. \r\nHi vọng có cơ hội hợp tác!\r\nBest regards,\r\nVân Khánh\r\n', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2016-12-08 12:05:05', '2016-12-08 12:05:05', NULL),
(24, 'Đỗ Vân Trang', '0915505445', 'trangbuong@yahoo.com', '1 Phùng Chí Kiên, Cầu Giấy, Hà Nội', 'Căn hộ trong khu Tràng An Complex mới tinh, nội thất cơ bản, vừa hoàn thành xong. Căn hộ 104m2 ban công hướng Hồ Tây, mát mẻ, sạch sẽ, khi dân trí cao. Căn hộ trên tầng 10 đảm bảo không gian yên tĩnh, thoáng mát, có view Hồ Tây, nhưng vẫn đảm bảo an toàn và thuận tiện trong sinh hoạt.\r\nCác tiện ích trong khu bao gồm bể bơi, khu tập gym, trung tâm thương mại, khu nhà hàng phục vụ cả ngày. Vị trí gần các tòa nhà văn phòng của quận Cầu Giấy và Quận Ba Đình, tiện đường ra sân bay (chưa đầy 30 phút), gần các son golf. \r\nChỉ cho người nước ngoài thuê. ', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2017-02-27 15:09:29', '2017-02-27 15:09:29', NULL),
(25, 'Lê Tuấn Anh', '0948168999', 'tuananh8983@gmail.com', 'Khu CC Tràng An Complex - Số 01 Phùng Chí Kiên', 'Căn hộ 1209 toà CT1 - Dự án Tràng An Complex . Diện tích thoòng thủy 96,6m2 , 3 phòng ngủ. Ban công hướng Nam , view Hồ Tây. \r\nNội thất đầy đủ : Bếp , Thiết bị vệ sinh, Sàn gỗ, Điều hoà ....', 1, 'Muốn liên hệ tìm khách cho thuê', 'Muốn liên hệ tìm khách bán', NULL, '2017-03-01 09:15:53', '2017-03-01 09:15:53', NULL),
(26, 'Thu Ha', '0968891488', 'hanguyen0178@gmail.com', '', '1. Dia chỉ: Nhà 806, lau 8, cc. CANTAVIL, P. An Phu, q2.\r\n   Chung cư nằm ở khu trung tâm Q2, ngay bên cạnh Parkson, Big C và hang hoat nhà hàng ăn uong tiện lợi, đối diện với Vincom Mega Mall Thảo Điền.\r\n- Chi phí quản lý thấp nhất so với các chung cư lân cận.\r\n- Hồ bơi. Chung cư có cung cấp dich vụ Housekeeping va Laundry.\r\n- Thiết kế kiến trúc rất thoáng mát và an toàn.\r\n- Bảo vệ 24/24\r\n\r\n2. Thông tin chi tiet:\r\n    - Dt: 80 m2 bao gồm ban công.\r\n    - 1 p. Khach / 3 p. Ngu \r\n    - 1 Toilet ( bao gồm Bồn tắm nằm)\r\n    - Full furnished.\r\n    - 1 TV/ Tu lanh/ Lo vi song/ Sofa/wifi/ Truyen hinh cap\r\n\r\n3. Tình trang nha:\r\n    - Vừa được bảo trì sơn nuoc và sơn sửa lại toan bộ. \r\n    - Bồn tắm v Bồn cầu cũng vừa duoc thay mới hoan toan. \r\n   - Kệ bếp cũng đươc thay mới toàn bộ dàn cánh v sơn mới lại bên trong.\r\n(Viec trùng tu lai sẽ kết thuc vao 17/3/2017)\r\n\r\n- Có thể bắt đầu cho thuê từ 19/3/2017\r\n\r\n\r\n4. GIÁ THUÊ: USD 850/ thang\r\n5. Thanh toan: theo thang hoac theo quy, chuyen khoan hoac tien mat.\r\n6. Đặt coc: 3 thang.\r\n\r\n7. Yêu cầu:\r\n  - Đối tượng khách là nguoi độc thân hoac gia đình không có trẻ nhỏ.\r\n  - Số luong nguoi ở tối đa 3 nguoi.\r\n\r\nXin vui lòng lien hệ:\r\nNguyen Thi Thu Ha\r\n096 889 1488\r\n\r\nXin cảm ơn va mong nhận duoc hồi âm.', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2017-03-14 11:35:08', '2017-03-14 11:35:08', NULL),
(27, 'Âu Văn Võ', '0912122532', 'auvanvo@gmail.com', 'Tràng An Complex, số 1 Phùng Chí kiên - Cầu Giấy - Hà Nội', 'Cho thuê căn hộ chung cư cao cấp tại Tràng An Complex số 1 Phùng Chí Kiên - Cầu Giấy - Hà Nội.\r\nDiện tích 100m, 02 phòng ngủ, 01 phòng đa năng, 02 phòng vệ sinh, ban công hướng nam.\r\nNhà mới bàn giao tháng 03/2017, nội thất: sàn gỗ, tủ bếp đầy đủ, 03 điều hòa không khí.', 1, 'Muốn liên hệ tìm khách cho thuê', 'Muốn liên hệ tìm khách bán', NULL, '2017-04-14 09:26:32', '2017-04-14 09:26:32', NULL),
(28, 'Nguyễn Văn Phùng', '0915268288', 'Roriect@icloud.com', 'P053510-Park hill 5- Timescity-Hai Bà Trưng-Hà Nội', 'Chào các Bạn, tôi có căn hộ mới (P053510-Park hill 5- Timescity-Hai Bà Trưng-Hà Nội), rộng 64m2, 2 phòng ngủ, 01 toilet. Căn hộ đầy đủ nội thất, tiện nghi và đang cần tìm khách cho thuê với giá 500usd/tháng.\r\nNhờ các Bạn tìm khách cho thuê giúp!\r\nPhone: 0915268288', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2017-04-18 19:07:24', '2017-04-18 19:07:24', NULL),
(29, 'Nguyễn Quỳnh Trang', '0913042849', 'trangaki@gmail.com', 'Starcity - 81 Lê Văn Lương - Thanh Xuân - Hà Nội', 'Nhà chung cư cao cấp, diện tích 112m2. bao gồm 3 phòng ngủ, 2 vệ sinh, 1 phòng khách, bếp, nhà kho và khu giặt giũ được trang bị đồ đạc đầy đủ, cao cấp.\r\nKhu nhà nằm gần ngã tư Lê Văn Lương- Láng Hạ, thuận tiện cho việc đi lại với cơ sở hạ tầng xung quanh phát triển, tiện lợi cho sinh hoạt.\r\nLiên hệ chính chủ: chị Trang - 0913042849, Giá thương lượng.', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2017-04-27 15:27:33', '2017-04-27 15:27:33', NULL),
(30, 'Nguyễn Thi Kim Chi', '0903966980', 'chinguyen76@gmail.com', '92 Nguyễn Hữu Cảnh, Phường 22, Quận Bình Thạnh', 'Cho thuê Căn hộ Saigon Pearl, 92 Nguyễn Hữu Cảnh, P.22, Q.Bình Thạnh. Diện tích: 92m2, 2 Bed, view nội khu shophouse. Căn hộ thoáng mát. Đầy đủ nội thất. Giá thuê: 1.200 usd/thang. Có thể thương lượng. Liên hệ: Ms Kim Chi (Jenny) : 0903 966 980 ', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2017-07-27 15:19:47', '2017-07-27 15:19:47', NULL),
(31, 'Le Thi Mai ', '0903431586', 'L.Mai@mitsui.com', 'Tòa T08, Times City', 'Cho thuê dài hạn căn hộ 01pn, 01 pk, bếp, diện tích 53m2. tầng 28 tòa T8, hướng Nam, đủ đồ dùng đẹp, khu đô thị Times City. Giá thuê  (thu về ) 12tr/tháng. Hợp đồng 1 năm, thanh toán 3 tháng 1 lần, đặt cọc 1 tháng. Chủ nhà sẽ hỗ trợ khách đăng ký tạm trú, khách tự đóng thuế. Giá thuê căn hộ đã có phí dịch vụ, điện nước trả theo giá nhà nước   ', 1, 'Muốn liên hệ tìm khách cho thuê', NULL, NULL, '2017-08-11 17:22:33', '2017-08-11 17:22:33', NULL);
